tableArr = [
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/html\" title=\"The HTML <html> element represents the root (top-level element) of an HTML document, so it is also referred to as the root element. All other elements must be descendants of this element.\"><code>&lt;html&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;html&gt;</code> element</strong> represents the root (top-level element) of an HTML document, so it is also referred to as the <em>root element</em>. All other elements must be descendants of this element.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/link\" title=\"The HTML External Resource Link element (<link>) specifies relationships between the current document and an external resource. This element is most commonly used to link to stylesheets, but is also used to establish site icons (both &quot;favicon&quot; style icons and mobile home screen/app icons) among other things.\"><code>&lt;link&gt;</code></a></td>\n   <td>The <strong>HTML External Resource Link element (<code>&lt;link&gt;</code>)</strong> specifies relationships between the current document and an external resource. This element is most commonly used to link to <a href=\"/en-US/docs/Glossary/CSS\" title=\"Cascading Style Sheets\">stylesheets</a>, but is also used to establish site icons (both \"favicon\" style icons and mobile home screen/app icons) among other things.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/meta\" title=\"The HTML <meta> element represents metadata that cannot be represented by other HTML meta-related elements, like <base>, <link>, <script>, <style> or <title>.\"><code>&lt;meta&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;meta&gt;</code> element</strong> represents <a href=\"/en-US/docs/Glossary/Metadata\" class=\"glossaryLink\" title=\"metadata: Metadata is — in its very simplest definition — data that describes data. For example, an HTML document is data, but HTML can also contain metadata in its <head> element that describes the document — for example who wrote it, and its summary.\">metadata</a> that cannot be represented by other HTML meta-related elements, like <a href=\"/en-US/docs/Web/HTML/Element/base\" title=\"The HTML <base> element specifies the base URL to use for all relative URLs contained within a document. There can be only one <base> element in a document.\"><code>&lt;base&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/link\" title=\"The HTML <link> element specifies relationships between the current document and an external resource. This element is most commonly used to link to stylesheets.\"><code>&lt;link&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/script\" title=\"The HTML <script> element is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.\"><code>&lt;script&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/style\" title=\"The HTML <style> element contains style information for a document, or part of a document.\"><code>&lt;style&gt;</code></a> or <a href=\"/en-US/docs/Web/HTML/Element/title\" title=\"The HTML Title element (<title>) defines the document's title that is shown in a browser's title bar or a page's tab.\"><code>&lt;title&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/style\" title=\"The HTML <style> element contains style information for a document, or part of a document.\"><code>&lt;style&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;style&gt;</code> element</strong> contains style information for a document, or part of a document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/title\" title=\"The HTML Title element (<title>) defines the document's title that is shown in a browser's title bar or a page's tab.\"><code>&lt;title&gt;</code></a></td>\n   <td>The <strong>HTML Title element</strong> (<strong><code>&lt;title&gt;</code></strong>) defines the document's title that is shown in a browser's title bar or a page's tab.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;body&gt;</code> Element</strong> represents the content of an HTML&nbsp;document. There can be only one <code>&lt;body&gt;</code> element in a document.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/address\" title=\"The HTML <address> element indicates that the enclosed HTML provides contact information for a person or people, or for an organization.\"><code>&lt;address&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;address&gt;</code> element</strong> indicates that the enclosed HTML provides contact information for a person or people, or for an organization.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/article\" title=\"The HTML <article> element represents a self-contained composition in a document, page, application, or site, which is intended to be independently distributable or reusable (e.g., in syndication). Examples include: a forum post, a magazine or newspaper article, or a blog entry.\"><code>&lt;article&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;article&gt;</code> element</strong> represents a self-contained composition in a document, page, application, or site, which is intended to be independently distributable or reusable (e.g., in syndication). Examples include: a forum post, a magazine or newspaper article, or a blog entry.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/aside\" title=\"The HTML <aside> element represents a portion of a document whose content is only indirectly related to the document's main content.\"><code>&lt;aside&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;aside&gt;</code> element</strong> represents a portion of a document whose content is only indirectly related to the document's main content.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/footer\" title=\"The HTML <footer> element represents a footer for its nearest sectioning content or sectioning root element. A footer typically contains information about the author of the section, copyright data or links to related documents.\"><code>&lt;footer&gt;</code></a></td>\n   <td>The<strong> HTML <code>&lt;footer&gt;</code> element</strong> represents a footer for its nearest <a href=\"/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document#Defining_Sections_in_HTML5\">sectioning content</a> or <a href=\"/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document#Sectioning_root\" title=\"Sections and Outlines of an HTML5 document#Sectioning root\">sectioning root</a> element. A footer typically contains information about the author of the section, copyright data or links to related documents.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/header\" title=\"The HTML <header> element represents introductory content, typically a group of introductory or navigational aids. It may contain some heading elements but also other elements like a logo, a search form, an author name, and so on.\"><code>&lt;header&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;header&gt;</code> element</strong> represents introductory content, typically a group of introductory or navigational aids. It may contain some heading elements but also other elements like a logo, a search form, an author name, and so on.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/h1\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h1&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h2\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h2&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h3\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h3&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h4\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h4&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h5\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h5&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h6\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h6&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;h1&gt;</code>–<code>&lt;h6&gt;</code> elements</strong> represent six levels of section headings. <code>&lt;h1&gt;</code> is the highest section level and <code>&lt;h6&gt;</code> is the lowest.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/hgroup\" title=\"The HTML <hgroup> element represents a multi-level heading for a section of a document. It groups a set of <h1>–<h6> elements.\"><code>&lt;hgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;hgroup&gt;</code> element</strong> represents a multi-level heading for a section of a document. It groups a set of <code><a href=\"/en-US/docs/Web/HTML/Element/Heading_Elements\">&lt;h1&gt;–&lt;h6&gt;</a></code> elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/main\" title=\"The HTML <main> element represents the dominant content of&nbsp;the <body> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.\"><code>&lt;main&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;main&gt;</code> element</strong> represents the dominant content of&nbsp;the <a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nav\" title=\"The HTML <nav> element represents a section of a page whose purpose is to provide navigation links, either within the current document or to other documents. Common examples of navigation sections are menus, tables of contents, and indexes.\"><code>&lt;nav&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;nav&gt;</code> element</strong> represents a section of a page whose purpose is to provide navigation links, either within the current document or to other documents. Common examples of navigation sections are menus, tables of contents, and indexes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/section\" title=\"The HTML <section> element represents a standalone section — which doesn't have a more specific semantic element to represent it — contained within an HTML document.\"><code>&lt;section&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;section&gt;</code> element</strong> represents a standalone section — which doesn't have a more specific semantic element to represent it — contained within an HTML document.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/blockquote\" title=\"The HTML <blockquote> Element (or HTML Block Quotation Element) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see Notes for how to change it). A URL for the source of the quotation may be given using the cite attribute, while a text representation of the source can be given using the <cite> element.\"><code>&lt;blockquote&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;blockquote&gt;</code> Element</strong> (or <em>HTML Block Quotation Element</em>) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see <a rel=\"internal\" href=\"#Usage_notes\">Notes</a> for how to change it). A URL for the source of the quotation may be given using the <strong>cite</strong> attribute, while a text representation of the source can be given using the <a href=\"/en-US/docs/Web/HTML/Element/cite\" title=\"The HTML Citation element (<cite>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.\"><code>&lt;cite&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dd\" title=\"The&nbsp;HTML <dd> element provides the details about or the definition of the preceding term (<dt>) in a description list (<dl>).\"><code>&lt;dd&gt;</code></a></td>\n   <td>The&nbsp;<strong>HTML <code>&lt;dd&gt;</code> element</strong> provides the details about or the definition of the preceding term (<a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a>) in a description list (<a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a>).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dir\" title=\"The obsolete HTML Directory element (<dir>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the user agent.\"><code>&lt;dir&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Directory element</strong> (<strong><code>&lt;dir&gt;</code></strong>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/div\" title=\"The HTML Content Division element (<div>) is the generic container for flow content. It has no effect on the content or layout until styled using CSS.\"><code>&lt;div&gt;</code></a></td>\n   <td>The <strong>HTML Content Division element</strong> (<strong><code>&lt;div&gt;</code></strong>) is the generic container for flow content. It has no effect on the content or layout until styled using CSS.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dl&gt;</code>&nbsp;</strong>element represents a description list.<strong>&nbsp;</strong>The element encloses a list of groups of terms (specified using the <a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a> element) and descriptions (provided by <a href=\"/en-US/docs/Web/HTML/Element/dd\" title=\"The&nbsp;HTML <dd> element provides the details about or the definition of the preceding term (<dt>) in a description list (<dl>).\"><code>&lt;dd&gt;</code></a> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dt&gt;</code> element</strong> specifies a term in a description or definition list, and as such must be used inside a <a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/figcaption\" title=\"The HTML <figcaption> element represents a caption or legend for the rest of the contents its parent <figure> element, if any.\"><code>&lt;figcaption&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;figcaption&gt;</code> element</strong> represents a caption or legend for the rest of the contents its parent <a href=\"/en-US/docs/Web/HTML/Element/figure\" title=\"The HTML <figure> element represents self-contained content, frequently with a caption (<figcaption>), and is typically referenced as a single unit.\"><code>&lt;figure&gt;</code></a> element, if any.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/figure\" title=\"The HTML <figure> element represents self-contained content, frequently with a caption (<figcaption>), and is typically referenced as a single unit.\"><code>&lt;figure&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;figure&gt;</code> element</strong> represents self-contained content, frequently with a caption (<a href=\"/en-US/docs/Web/HTML/Element/figcaption\" title=\"The HTML <figcaption> element represents a caption or legend for the rest of the contents its parent <figure> element, if any.\"><code>&lt;figcaption&gt;</code></a>), and is typically referenced as a single unit.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/hr\" title=\"The HTML <hr> element represents a thematic break between paragraph-level elements (for example, a change of scene in a story, or a shift of topic with a section); historically, this has been presented as a horizontal rule or line.\"><code>&lt;hr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;hr&gt;</code> element</strong> represents a thematic break between paragraph-level elements (for example, a change of scene in a story, or a shift of topic with a section); historically, this has been presented as a horizontal rule or line.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/li\" title=\"The HTML <li> element is used to represent an item in a list. It must be contained in a parent element: an ordered list (<ol>), an unordered list (<ul>), or a menu (<menu>). In menus and unordered lists, list items are usually displayed using bullet points. In ordered lists, they are usually displayed with an ascending counter on the left, such as a number or letter.\"><code>&lt;li&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;li&gt;</code> element</strong> is used to represent an item in a list. It must be contained in a parent element: an ordered list (<a href=\"/en-US/docs/Web/HTML/Element/ol\" title=\"The HTML <ol> element represents an ordered list of items, typically rendered as a numbered list.\"><code>&lt;ol&gt;</code></a>), an unordered list (<a href=\"/en-US/docs/Web/HTML/Element/ul\" title=\"The HTML <ul> element represents an unordered list of items, typically rendered as a bulleted list.\"><code>&lt;ul&gt;</code></a>), or a menu (<a href=\"/en-US/docs/Web/HTML/Element/menu\" title=\"The HTML <menu> element represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.\"><code>&lt;menu&gt;</code></a>). In menus and unordered lists, list items are usually displayed using bullet points. In ordered lists, they are usually displayed with an ascending counter on the left, such as a number or letter.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/main\" title=\"The HTML <main> element represents the dominant content of&nbsp;the <body> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.\"><code>&lt;main&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;main&gt;</code> element</strong> represents the dominant content of&nbsp;the <a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ol\" title=\"The HTML <ol> element represents an ordered list of items, typically rendered as a numbered list.\"><code>&lt;ol&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ol&gt;</code> element</strong> represents an ordered list of items, typically rendered as a numbered list.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/p\" title=\"The HTML <p> element represents a paragraph of text.\"><code>&lt;p&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;p&gt;</code> element</strong> represents a paragraph of text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/pre\" title=\"The HTML <pre> element represents preformatted text which is to be presented exactly as written in the HTML file.\"><code>&lt;pre&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;pre&gt;</code> element</strong> represents preformatted text which is to be presented exactly as written in the HTML file.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ul\" title=\"The HTML <ul> element represents an unordered list of items, typically rendered as a bulleted list.\"><code>&lt;ul&gt;</code></a></td>\n   <td>The<strong> HTML <code>&lt;ul&gt;</code> element</strong> represents an unordered list of items, typically rendered as a bulleted list.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/a\" title=\"The HTML <a> element (or anchor element) creates a hyperlink to other web pages, files, locations within the same page, email addresses, or any other URL.\"><code>&lt;a&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;a&gt;</code> element</strong> (or <em>anchor</em> element) creates a hyperlink to other web pages, files, locations within the same page, email addresses, or any other URL.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/abbr\" title=\"The HTML Abbreviation element (<abbr>) represents an abbreviation or acronym; the optional title attribute can provide an expansion or description for the abbreviation.\"><code>&lt;abbr&gt;</code></a></td>\n   <td>The <strong>HTML Abbreviation element </strong>(<strong><code>&lt;abbr&gt;</code></strong>) represents an abbreviation or acronym; the optional <code><a href=\"/en-US/docs/Web/HTML/Global_attributes#attr-title\">title</a></code> attribute can provide an expansion or description for the abbreviation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/b\" title=\"The HTML Bring Attention To element (<b>)&nbsp; is used to draw the reader's attention to the element's contents, which are not otherwise granted special importance.\"><code>&lt;b&gt;</code></a></td>\n   <td>The <strong>HTML Bring Attention To element</strong> (<strong><code>&lt;b&gt;</code></strong>)&nbsp; is used to draw the reader's attention to the element's contents, which are not otherwise granted special importance.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bdi\" title=\"The HTML BiDirectional Isolation element (<bdi>)&nbsp; is used to indicate spans of text which might need to be rendered in the opposite direction than the surrounding text.\"><code>&lt;bdi&gt;</code></a></td>\n   <td>The HTML <strong>BiDirectional Isolation element</strong> (<strong><code>&lt;bdi&gt;</code></strong>)&nbsp; is used to indicate spans of text which might need to be rendered in the opposite direction than the surrounding text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bdo\" title=\"The HTML Bidirectional Text Override element (<bdo>) overrides the current directionality of text, so that the text within is rendered in a different direction.\"><code>&lt;bdo&gt;</code></a></td>\n   <td>The <strong>HTML Bidirectional Text Override element</strong> (<strong><code>&lt;bdo&gt;</code></strong>) overrides the current directionality of text, so that the text within is rendered in a different direction.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/br\" title=\"The HTML <br> element produces a line break in text (carriage-return). It is useful for writing a poem or an address, where the division of lines is significant.\"><code>&lt;br&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;br&gt;</code> element</strong> produces a line break in text (carriage-return). It is useful for writing a poem or an address, where the division of lines is significant.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/cite\" title=\"The HTML Citation element (<cite>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.\"><code>&lt;cite&gt;</code></a></td>\n   <td>The <strong>HTML Citation element</strong> (<strong><code>&lt;cite&gt;</code></strong>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/code\" title=\"The HTML <code> element displays its contents styled in a fashion intended to indicate that the text is a short fragment of computer code.\"><code>&lt;code&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;code&gt;</code> element</strong> displays its contents styled in a fashion intended to indicate that the text is a short fragment of computer code.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/data\" title=\"The HTML <data> element links a given content with a machine-readable translation. If the content is time- or date-related, the <time> element must be used.\"><code>&lt;data&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;data&gt;</code> element</strong> links a given content with a machine-readable translation. If the content is time- or date-related, the <a href=\"/en-US/docs/Web/HTML/Element/time\" title=\"The HTML <time> element represents a specific period in time. It may include the&nbsp;datetime&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.\"><code>&lt;time&gt;</code></a> element must be used.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dfn\" title=\"The HTML Definition element (<dfn>) is used to indicate the term being defined within the context of a definition phrase or sentence.\"><code>&lt;dfn&gt;</code></a></td>\n   <td>The <strong>HTML Definition element</strong> (<strong><dfn>&lt;dfn&gt;</dfn></strong>) is used to indicate the term being defined within the context of a definition phrase or sentence.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/em\" title=\"The HTML <em> element marks text that has stress emphasis. The <em> element can be nested, with each level of nesting indicating a greater degree of emphasis.\"><code>&lt;em&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;em&gt;</code> element</strong> marks text that has stress emphasis. The <code>&lt;em&gt;</code> element can be nested, with each level of nesting indicating a greater degree of emphasis.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/i\" title=\"The HTML <i> element represents a range of text that is set off from the normal text for some reason. Some examples include technical terms, foreign language phrases, or fictional character thoughts. It is typically displayed in italic type.\"><code>&lt;i&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;i&gt;</code> element</strong> represents a range of text that is set off from the normal text for some reason. Some examples include technical terms, foreign language phrases, or fictional character thoughts. It is typically displayed in italic type.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/kbd\" title=\"The HTML Keyboard Input element (<kbd>) represents a span of inline text denoting textual user input from a keyboard, voice input, or any other text entry device.\"><code>&lt;kbd&gt;</code></a></td>\n   <td>The <strong>HTML Keyboard Input element</strong> (<strong><code>&lt;kbd&gt;</code></strong>) represents a span of inline text denoting textual user input from a keyboard, voice input, or any other text entry device.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/mark\" title=\"The HTML Mark Text element (<mark>) represents text which is marked or highlighted for reference or notation purposes, due to the marked passage's relevance or importance in the enclosing context.\"><code>&lt;mark&gt;</code></a></td>\n   <td>The <strong>HTML Mark Text element</strong> (<strong><code>&lt;mark&gt;</code></strong>) represents text which is <strong>marked</strong> or <strong>highlighted</strong> for reference or notation purposes, due to the marked passage's relevance or importance in the enclosing context.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/q\" title=\"The HTML <q> element  indicates that the enclosed text is a short inline quotation. Most modern browsers implement this by surrounding the text in quotation marks. \"><code>&lt;q&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;q&gt;</code> element </strong> indicates that the enclosed text is a short inline quotation. Most modern browsers implement this by surrounding the text in quotation marks. </td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Base (<code>&lt;rb&gt;</code>) element</strong> is used to delimit the base text component of a&nbsp; <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> annotation, i.e. the text that is being annotated.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rp\" title=\"The HTML Ruby Fallback Parenthesis (<rp>) element is used to provide fall-back parentheses for browsers that do not support display of ruby annotations using the <ruby> element.\"><code>&lt;rp&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Fallback Parenthesis (<code>&lt;rp&gt;</code>) element</strong> is used to provide fall-back parentheses for browsers that do not support display of ruby annotations using the <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rt\" title=\"The HTML Ruby Text (<rt>) element specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <rt> element must always be contained within a <ruby> element.\"><code>&lt;rt&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Text (<code>&lt;rt&gt;</code>) element</strong> specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <code>&lt;rt&gt;</code> element must always be contained within a <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rtc\" title=\"The HTML Ruby Text Container (<rtc>) element embraces semantic annotations of characters presented in a ruby of <rb> elements used inside of <ruby> element. <rb> elements can have both pronunciation (<rt>) and semantic (<rtc>) annotations.\"><code>&lt;rtc&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Text Container (<code>&lt;rtc&gt;</code>) element</strong> embraces semantic annotations of characters presented in a ruby of <a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a> elements used inside of <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element. <a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a> elements can have both pronunciation (<a href=\"/en-US/docs/Web/HTML/Element/rt\" title=\"The HTML Ruby Text (<rt>) element specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <rt> element must always be contained within a <ruby> element.\"><code>&lt;rt&gt;</code></a>) and semantic (<a href=\"/en-US/docs/Web/HTML/Element/rtc\" title=\"The HTML Ruby Text Container (<rtc>) element embraces semantic annotations of characters presented in a ruby of <rb> elements used inside of <ruby> element. <rb> elements can have both pronunciation (<rt>) and semantic (<rtc>) annotations.\"><code>&lt;rtc&gt;</code></a>) annotations.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ruby&gt;</code> element</strong> represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/s\" title=\"The HTML <s> element renders text with a strikethrough, or a line through it. Use the <s> element to represent things that are no longer relevant or no longer accurate. However, <s> is not appropriate when indicating document edits; for that, use the <del> and <ins> elements, as appropriate.\"><code>&lt;s&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;s&gt;</code> element</strong> renders text with a strikethrough, or a line through it. Use the <code>&lt;s&gt;</code> element to represent things that are no longer relevant or no longer accurate. However, <code>&lt;s&gt;</code> is not appropriate when indicating document edits; for that, use the <a href=\"/en-US/docs/Web/HTML/Element/del\" title=\"The HTML <del> element represents a range of text that has been deleted from a document.\"><code>&lt;del&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/ins\" title=\"The HTML <ins> element represents a range of text that has been added to a document.\"><code>&lt;ins&gt;</code></a> elements, as appropriate.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/samp\" title=\"The HTML Sample Element (<samp>) is used to enclose inline text which represents sample (or quoted) output from a computer program.\"><code>&lt;samp&gt;</code></a></td>\n   <td>The <strong>HTML Sample Element</strong> (<strong><code>&lt;samp&gt;</code></strong>) is used to enclose inline text which represents sample (or quoted) output from a computer program.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/small\" title=\"The HTML <small> element makes the text font size one size smaller (for example, from large to medium, or from small to x-small) down to the browser's minimum font size.&nbsp; In HTML5, this element is repurposed to represent side-comments and small print, including copyright and legal text, independent of its styled presentation.\"><code>&lt;small&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;small&gt;</code></strong> <strong>element </strong>makes the text <em>font size</em> one size smaller (for example, from large to medium, or from small to x-small) down to the browser's minimum font size.&nbsp; In HTML5, this element is repurposed to represent side-comments and small print, including copyright and legal text, independent of its styled presentation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/span\" title=\"The HTML <span> element is a generic inline container for phrasing content, which does not inherently represent anything. It can be used to group elements for styling purposes (using the class or id attributes), or because they share attribute values, such as lang.\"><code>&lt;span&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;span&gt;</code> element</strong> is a generic inline container for phrasing content, which does not inherently represent anything. It can be used to group elements for styling purposes (using the <code>class</code> or <code>id</code> attributes), or because they share attribute values, such as <code>lang</code>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/strong\" title=\"The HTML Strong Importance Element (<strong>) indicates that its contents have strong importance, seriousness, or urgency. Browsers typically render the contents in bold type.\"><code>&lt;strong&gt;</code></a></td>\n   <td>The HTML <strong>Strong Importance Element</strong> (<strong><code>&lt;strong&gt;</code>)</strong> indicates that its contents have strong importance, seriousness, or urgency. Browsers typically render the contents in bold type.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/sub\" title=\"The HTML Subscript element (<sub>) specifies inline text which should be displayed as subscript for solely typographical reasons.\"><code>&lt;sub&gt;</code></a></td>\n   <td>The <strong>HTML Subscript element</strong> (<strong><code>&lt;sub&gt;</code></strong>) specifies inline text which should be displayed as subscript for solely typographical reasons.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/sup\" title=\"The HTML Superscript element (<sup>) specifies inline text which is to be displayed as superscript for solely typographical reasons.\"><code>&lt;sup&gt;</code></a></td>\n   <td>The <strong>HTML Superscript element</strong> (<strong><code>&lt;sup&gt;</code></strong>) specifies inline text which is to be displayed as superscript for solely typographical reasons.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/time\" title=\"The HTML <time> element represents a specific period in time. It may include the&nbsp;datetime&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.\"><code>&lt;time&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;time&gt;</code> element</strong> represents a specific period in time. It may include the&nbsp;<strong>datetime</strong>&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tt\" title=\"The obsolete HTML Teletype Text element (<tt>) creates inline text which is presented using the user agent's default monospace font face.\"><code>&lt;tt&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Teletype Text element</strong> (<strong><code>&lt;tt&gt;</code></strong>) creates inline text which is presented using the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent's: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent's</a> default monospace font face.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/u\" title=\"The HTML Unarticulated Annotation element (<u>) represents a span of inline text which should be rendered in a way that indicates that it has a non-textual annotation.\"><code>&lt;u&gt;</code></a></td>\n   <td>The <strong>HTML Unarticulated Annotation</strong> element (<strong><code>&lt;u&gt;</code></strong>) represents a span of inline text which should be rendered in a way that indicates that it has a non-textual annotation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/var\" title=\"The HTML Variable element (<var>) represents the name of a variable in a mathematical expression or a programming context.\"><code>&lt;var&gt;</code></a></td>\n   <td>The <strong>HTML Variable element</strong> (<strong><code>&lt;var&gt;</code></strong>) represents the name of a variable in a mathematical expression or a programming context.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/wbr\" title=\"The HTML <wbr> element represents a word break opportunity—a position within text where the browser may optionally break a line, though its line-breaking rules would not otherwise create a break at that location.\"><code>&lt;wbr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;wbr&gt;</code> element</strong> represents a word break opportunity—a position within text where the browser may optionally break a line, though its line-breaking rules would not otherwise create a break at that location.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/area\" title=\"The HTML <area> element defines a hot-spot region on an image, and optionally associates it with a hypertext link. This element is used only within a <map> element.\"><code>&lt;area&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;area&gt;</code> element</strong> defines a hot-spot region on an image, and optionally associates it with a <a href=\"/en-US/docs/Glossary/Hyperlink\" class=\"glossaryLink\" title=\"hypertext link: Hyperlinks connect webpages or data items to one another. In HTML, <a> elements define hyperlinks from a spot on a webpage (like a text string or image) to another spot on some other webpage (or even on the same page).\">hypertext link</a>. This element is used only within a <a href=\"/en-US/docs/Web/HTML/Element/map\" title=\"The HTML <map> element is used with <area> elements to define an image map (a clickable link area).\"><code>&lt;map&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;audio&gt;</code> element</strong> is used to embed sound content in documents. It may contain one or more audio sources, represented using the <code>src</code> attribute or the <a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a <a href=\"/en-US/docs/Web/API/MediaStream\" title=\"The MediaStream interface represents a stream of media content. A stream consists of several tracks such as&nbsp;video or audio tracks. Each track is specified as an instance of MediaStreamTrack.\"><code>MediaStream</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;img&gt;</code> element</strong> embeds an image into the document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/map\" title=\"The HTML <map> element is used with <area> elements to define an image map (a clickable link area).\"><code>&lt;map&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;map&gt;</code> element</strong> is used with <a href=\"/en-US/docs/Web/HTML/Element/area\" title=\"The HTML <area> element defines a hot-spot region on an image, and optionally associates it with a hypertext link. This element is used only within a <map> element.\"><code>&lt;area&gt;</code></a> elements to define an image map (a clickable link area).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/track\" title=\"The HTML <track> element is used as a child of the media elements <audio> and <video>. It lets you specify timed text tracks (or time-based data), for example to automatically handle subtitles. The tracks are formatted in WebVTT format (.vtt files) — Web Video Text Tracks or&nbsp;Timed Text Markup Language (TTML).\"><code>&lt;track&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;track&gt;</code> element</strong> is used as a child of the media elements <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a>. It lets you specify timed text tracks (or time-based data), for example to automatically handle subtitles. The tracks are formatted in <a href=\"/en-US/docs/Web/API/Web_Video_Text_Tracks_Format\">WebVTT format</a> (<code>.vtt</code> files) — Web Video Text Tracks or&nbsp;<a rel=\"noopener\" href=\"https://w3c.github.io/ttml2/index.html\" class=\"external external-icon\">Timed Text Markup Language (TTML).</a></td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a></td>\n   <td>The <strong>HTML Video element</strong> (<strong><code>&lt;video&gt;</code></strong>) embeds a media player which supports video playback into the document.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/applet\" title=\"The obsolete HTML Applet Element (<applet>) embeds a Java applet into the document; this element has been deprecated in favor of <object>.\"><code>&lt;applet&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Applet Element</strong> (<strong><code>&lt;applet&gt;</code></strong>) embeds a Java applet into the document; this element has been deprecated in favor of <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;embed&gt;</code> element</strong> embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/iframe\" title=\"The HTML Inline Frame element (<iframe>) represents a nested browsing context, effectively embedding another HTML page into the current page.\"><code>&lt;iframe&gt;</code></a></td>\n   <td>The <strong>HTML Inline Frame element (<code>&lt;iframe&gt;</code>)</strong> represents a nested browsing context, effectively embedding another HTML page into the current page.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noembed\" title=\"The <noembed> element is an obsolete, non-standard way to provide alternative, or &quot;fallback&quot;, content for browsers that do not support the <embed> element or do not support the type of embedded content an author wishes to use.\"><code>&lt;noembed&gt;</code></a></td>\n   <td>The <code><strong>&lt;noembed&gt;</strong></code> element is an obsolete, non-standard way to provide alternative, or \"fallback\", content for browsers that do not support the <a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a> element or do not support the type of <a href=\"/en-US/docs/Web/Guide/HTML/Content_categories#Embedded_content\">embedded content</a> an author wishes to use.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;object&gt;</code> element</strong> represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/param\" title=\"The HTML <param> element defines parameters for an <object> element.\"><code>&lt;param&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;param&gt;</code> element</strong> defines parameters for an <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/picture\" title=\"The HTML <picture> element serves as a container for zero or more <source> elements and one <img> element to provide versions of an image for different display device scenarios.\"><code>&lt;picture&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;picture&gt;</code> element</strong> serves as a container for zero or more <a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a> elements and one <a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a> element to provide versions of an image for different display device scenarios.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;source&gt;</code> element</strong> specifies multiple media resources for the <a href=\"/en-US/docs/Web/HTML/Element/picture\" title=\"The HTML <picture> element serves as a container for zero or more <source> elements and one <img> element to provide versions of an image for different display device scenarios.\"><code>&lt;picture&gt;</code></a>, the <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> element, or the <a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a> element. It is an empty element. It is commonly used to serve the same media content in <a href=\"/en-US/docs/Media_formats_supported_by_the_audio_and_video_elements\">multiple formats supported by different browsers</a>.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/canvas\" title=\"Use the HTML <canvas> element with either the canvas scripting API or the WebGL API to draw graphics and animations.\"><code>&lt;canvas&gt;</code></a></td>\n   <td>Use the <strong>HTML <code>&lt;canvas&gt;</code> element</strong> with either the <a href=\"/en-US/docs/Web/API/Canvas_API\">canvas scripting API</a> or the <a href=\"/en-US/docs/Web/API/WebGL_API\">WebGL API</a> to draw graphics and animations.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noscript\" title=\"The HTML <noscript> element defines a section of HTML to be inserted if a script type on the page is unsupported or if scripting is currently turned off in the browser.\"><code>&lt;noscript&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;noscript&gt;</code> element</strong> defines a section of HTML to be inserted if a script type on the page is unsupported or if scripting is currently turned off in the browser.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/script\" title=\"The HTML <script> element is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.\"><code>&lt;script&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;script&gt;</code> element</strong> is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/del\" title=\"The HTML <del> element represents a range of text that has been deleted from a document.\"><code>&lt;del&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;del&gt;</code> element</strong> represents a range of text that has been deleted from a document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ins\" title=\"The HTML <ins> element represents a range of text that has been added to a document.\"><code>&lt;ins&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ins&gt;</code> element</strong> represents a range of text that has been added to a document.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/caption\" title=\"The HTML Table Caption element (<caption>) specifies the caption (or title) of a table, and if used is always the first child of a <table>.\"><code>&lt;caption&gt;</code></a></td>\n   <td>The <strong>HTML Table Caption element</strong> (<strong><code>&lt;caption&gt;</code></strong>) specifies the caption (or title) of a table, and if used is <em>always</em> the first child of a <a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/col\" title=\"The HTML <col> element defines a column within a table and is used for defining common semantics on all common cells. It is generally found within a <colgroup> element.\"><code>&lt;col&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;col&gt;</code> element</strong> defines a column within a table and is used for defining common semantics on all common cells. It is generally found within a <a href=\"/en-US/docs/Web/HTML/Element/colgroup\" title=\"The HTML <colgroup> element defines a group of columns within a table.\"><code>&lt;colgroup&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/colgroup\" title=\"The HTML <colgroup> element defines a group of columns within a table.\"><code>&lt;colgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;colgroup&gt;</code> element</strong> defines a group of columns within a table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;table&gt;</code> element</strong> represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tbody\" title=\"The HTML Table Body element (<tbody>) encapsulates a set of table row (<tr> elements, indicating that they comprise the body of the table (<table>).\"><code>&lt;tbody&gt;</code></a></td>\n   <td>The <strong>HTML Table Body element</strong> (<strong><code>&lt;tbody&gt;</code></strong>) encapsulates a set of table row (<a href=\"/en-US/docs/Web/HTML/Element/tr\" title=\"The HTML <tr> element defines a row of cells in a table. The row's cells can then be established using a mix of <td> (data cell) and <th> (header cell) elements.The HTML <tr> element specifies that the markup contained inside the <tr> block comprises one row of a table, inside which the <th> and <td> elements create header and data cells, respectively, within the row.\"><code>&lt;tr&gt;</code></a> elements, indicating that they comprise the body of the table (<a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a>).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;td&gt;</code> element</strong> defines a cell of a table that contains data. It participates in the <em>table model</em>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tfoot\" title=\"The HTML <tfoot> element defines a set of rows summarizing the columns of the table.\"><code>&lt;tfoot&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;tfoot&gt;</code> element</strong> defines a set of rows summarizing the columns of the table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML <th> element defines a cell as header of a group of table cells. The exact nature of this group is defined by the scope and headers attributes.\"><code>&lt;th&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;th&gt;</code> element</strong> defines a cell as header of a group of table cells. The exact nature of this group is defined by the <code><a href=\"/en-US/docs/Web/HTML/Element/th#attr-scope\">scope</a></code> and <code><a href=\"/en-US/docs/Web/HTML/Element/th#attr-headers\">headers</a></code> attributes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/thead\" title=\"The HTML <thead> element defines a set of rows defining the head of the columns of the table.\"><code>&lt;thead&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;thead&gt;</code> element</strong> defines a set of rows defining the head of the columns of the table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tr\" title=\"The HTML <tr> element defines a row of cells in a table. The row's cells can then be established using a mix of <td> (data cell) and <th> (header cell) elements.The HTML <tr> element specifies that the markup contained inside the <tr> block comprises one row of a table, inside which the <th> and <td> elements create header and data cells, respectively, within the row.\"><code>&lt;tr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;tr&gt;</code> element</strong> defines a row of cells in a table. The row's cells can then be established using a mix of <a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a> (data cell) and <a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML &amp;lt;th&amp;gt; element defines a cell as header of a group of table cells. The exact nature of this group is defined by the {{htmlattrxref(&quot;scope&quot;, &quot;th&quot;)}} and {{htmlattrxref(&quot;headers&quot;, &quot;th&quot;)}} attributes.\"><code>&lt;th&gt;</code></a> (header cell) elements.The HTML <strong><code>&lt;tr&gt;</code></strong> element specifies that the markup contained inside the <code>&lt;tr&gt;</code> block comprises one row of a table, inside which the <a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML &amp;lt;th&amp;gt; element defines a cell as header of a group of table cells. The exact nature of this group is defined by the {{htmlattrxref(&quot;scope&quot;, &quot;th&quot;)}} and {{htmlattrxref(&quot;headers&quot;, &quot;th&quot;)}} attributes.\"><code>&lt;th&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a> elements create header and data cells, respectively, within the row.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/button\" title=\"The HTML <button> element represents a clickable button, which can be used in forms or anywhere in a document that needs simple, standard button functionality.\"><code>&lt;button&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;button&gt;</code> element</strong> represents a clickable button, which can be used in <a href=\"/en-US/docs/Learn/HTML/Forms\">forms</a> or anywhere in a document that needs simple, standard button functionality.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/datalist\" title=\"The HTML <datalist> element contains a set of <option> elements that represent the values available for other controls.\"><code>&lt;datalist&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;datalist&gt;</code> element</strong> contains a set of <a href=\"/en-US/docs/Web/HTML/Element/option\" title=\"The HTML <option> element is used to define an item contained in a <select>, an <optgroup>, or a <datalist>&nbsp;element. As such,&nbsp;<option>&nbsp;can represent menu items in popups and other lists of items in an HTML document.\"><code>&lt;option&gt;</code></a> elements that represent the values available for other controls.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/fieldset\" title=\"The HTML <fieldset> element is used to group several controls as well as labels (<label>) within a web form.\"><code>&lt;fieldset&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;fieldset&gt;</code> element</strong> is used to group several controls as well as labels (<a href=\"/en-US/docs/Web/HTML/Element/label\" title=\"The HTML <label> element represents a caption for an item in a user interface.\"><code>&lt;label&gt;</code></a>) within a web form.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/form\" title=\"The HTML <form> element represents a document section that contains interactive controls for submitting information to a web server.\"><code>&lt;form&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;form&gt;</code> element</strong> represents a document section that contains interactive controls for submitting information to a web server.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/input\" title=\"The HTML <input> element is used to create interactive controls for web-based forms in order to accept data from the user; a wide variety of types of input data and control widgets are available, depending on the device and user agent.\"><code>&lt;input&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;input&gt;</code> element</strong> is used to create interactive controls for web-based forms in order to accept data from the user; a wide variety of types of input data and control widgets are available, depending on the device and <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/label\" title=\"The HTML <label> element represents a caption for an item in a user interface.\"><code>&lt;label&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;label&gt;</code> element</strong> represents a caption for an item in a user interface.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/legend\" title=\"The HTML <legend> element represents a caption for the content of its parent <fieldset>.\"><code>&lt;legend&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;legend&gt;</code> element</strong> represents a caption for the content of its parent <a href=\"/en-US/docs/Web/HTML/Element/fieldset\" title=\"The HTML <fieldset> element is used to group several controls as well as labels (<label>) within a web form.\"><code>&lt;fieldset&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/meter\" title=\"The HTML <meter> element represents either a scalar value within a known range or a fractional value.\"><code>&lt;meter&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;meter&gt;</code> element</strong> represents either a scalar value within a known range or a fractional value.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/optgroup\" title=\"The HTML <optgroup> element creates a grouping of options within a <select> element.\"><code>&lt;optgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;optgroup&gt;</code> element</strong> creates a grouping of options within a <a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/option\" title=\"The HTML <option> element is used to define an item contained in a <select>, an <optgroup>, or a <datalist>&nbsp;element. As such,&nbsp;<option>&nbsp;can represent menu items in popups and other lists of items in an HTML document.\"><code>&lt;option&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;option&gt;</code> element</strong> is used to define an item contained in a <a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a>, an <a href=\"/en-US/docs/Web/HTML/Element/optgroup\" title=\"The HTML <optgroup> element creates a grouping of options within a <select> element.\"><code>&lt;optgroup&gt;</code></a>, or a <a href=\"/en-US/docs/Web/HTML/Element/datalist\" title=\"The HTML <datalist> element contains a set of <option> elements that represent the values available for other controls.\"><code>&lt;datalist&gt;</code></a>&nbsp;element. As such,&nbsp;<code>&lt;option&gt;</code>&nbsp;can represent menu items in popups and other lists of items in an HTML document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/output\" title=\"The HTML Output element (<output>) is a container element into which a site or app can inject the results of a calculation or the outcome of a user action.\"><code>&lt;output&gt;</code></a></td>\n   <td>The <strong>HTML Output element</strong> (<strong><code>&lt;output&gt;</code></strong>) is a container element into which a site or app can inject the results of a calculation or the outcome of a user action.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/progress\" title=\"The HTML <progress> element displays an indicator showing the completion progress of a task, typically displayed as a progress bar.\"><code>&lt;progress&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;progress&gt;</code> element</strong> displays an indicator showing the completion progress of a task, typically displayed as a progress bar.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;select&gt;</code> element</strong> represents a control that provides a menu of options:</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/textarea\" title=\"The HTML <textarea> element represents a multi-line plain-text editing control, useful when you want to allow users to enter a sizeable amount of free-form text, for example a comment on a review or feedback form.\"><code>&lt;textarea&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;textarea&gt;</code> element</strong> represents a multi-line plain-text editing control, useful when you want to allow users to enter a sizeable amount of free-form text, for example a comment on a review or feedback form.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/details\" title=\"The HTML Details Element (<details>) creates a disclosure widget in which information is visible only when the widget is toggled into an &quot;open&quot; state.\"><code>&lt;details&gt;</code></a></td>\n   <td>The <strong>HTML Details Element (<code>&lt;details&gt;</code>)</strong> creates a disclosure widget in which information is visible only when the widget is toggled into an \"open\" state.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dialog\" title=\"The HTML <dialog> element represents a dialog box or other interactive component, such as an inspector or window.\"><code>&lt;dialog&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dialog&gt;</code> element</strong> represents a dialog box or other interactive component, such as an inspector or window.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menu\" title=\"The HTML <menu> element represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.\"><code>&lt;menu&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menu&gt;</code> element</strong> represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menuitem\" title=\"The HTML <menuitem> element represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.\"><code>&lt;menuitem&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menuitem&gt;</code> element</strong> represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/summary\" title=\"The HTML Disclosure Summary element (<summary>) element specifies a summary, caption, or legend for a <details> element's disclosure box.\"><code>&lt;summary&gt;</code></a></td>\n   <td>The <strong>HTML Disclosure Summary element</strong> (<strong><code>&lt;summary&gt;</code></strong>) element specifies a summary, caption, or legend for a <a href=\"/en-US/docs/Web/HTML/Element/details\" title=\"The HTML Details Element (&amp;lt;details&amp;gt;) creates a disclosure widget in which information is visible only when the widget is toggled into an &quot;open&quot; state.\"><code>&lt;details&gt;</code></a> element's disclosure box.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/content\" title=\"The HTML <content> element—an obsolete part of the Web Components suite of technologies—was used inside of Shadow DOM as an insertion point, and wasn't meant to be used in ordinary HTML.\"><code>&lt;content&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;content&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> suite of technologies—was used inside of <a href=\"/en-US/docs/Web/Web_Components/Shadow_DOM\">Shadow DOM</a> as an <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>, and wasn't meant to be used in ordinary HTML.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/element\" title=\"The obsolete HTML <element> element was part of the Web Components specification; it was intended to be used to define new custom DOM elements.\"><code>&lt;element&gt;</code></a></td>\n   <td>The obsolete <strong>HTML <code>&lt;element&gt;</code> element</strong> was part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> specification; it was intended to be used to define new custom DOM elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/shadow\" title=\"The HTML <shadow> element—an obsolete part of the Web Components technology suite—was intended to be used as a shadow DOM insertion point.\"><code>&lt;shadow&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;shadow&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—was intended to be used as a shadow DOM <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/slot\" title=\"The HTML <slot> element—part of the Web Components technology suite—is a placeholder inside a web component that you can fill with your own markup, which lets you create separate DOM trees and present them together.\"><code>&lt;slot&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;slot&gt;</code> element</strong>—part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—is a placeholder inside a web component that you can fill with your own markup, which lets you create separate DOM trees and present them together.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/template\" title=\"The HTML Content Template (<template>) element is a mechanism for holding client-side content that is not to be rendered when a page is loaded but may subsequently be instantiated during runtime using JavaScript.\"><code>&lt;template&gt;</code></a></td>\n   <td>The <strong>HTML Content Template (<code>&lt;template&gt;</code>) element</strong> is a mechanism for holding client-side content that is not to be rendered when a page is loaded but may subsequently be instantiated during runtime using JavaScript.</td>\n  </tr>\n\n </tbody>\n",
    "\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/acronym\" title=\"The HTML Acronym Element (<acronym>) allows authors to clearly indicate a sequence of characters that compose an acronym or abbreviation for a word. This element has been removed in HTML5. Use&nbsp;<abbr> element.\"><code>&lt;acronym&gt;</code></a></td>\n   <td>The HTML Acronym Element (<code>&lt;acronym&gt;</code>) allows authors to clearly indicate a sequence of characters that compose an acronym or abbreviation for a word. This element has been removed in HTML5. Use&nbsp;<a href=\"/en-US/docs/Web/HTML/Element/abbr\" title=\"The HTML Abbreviation element (<abbr>) represents an abbreviation or acronym; the optional title attribute can provide an expansion or description for the abbreviation.\"><code>&lt;abbr&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/applet\" title=\"The obsolete HTML Applet Element (<applet>) embeds a Java applet into the document; this element has been deprecated in favor of <object>.\"><code>&lt;applet&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Applet Element</strong> (<strong><code>&lt;applet&gt;</code></strong>) embeds a Java applet into the document; this element has been deprecated in favor of <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/basefont\" title=\"The obsolete HTML Base Font element (<basefont>) sets a default font face, size, and color for the other elements which are descended from its parent element.\"><code>&lt;basefont&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Base Font element</strong> (<strong><code>&lt;basefont&gt;</code></strong>) sets a default font face, size, and color for the other elements which are descended from its parent element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bgsound\" title=\"The Internet Explorer only HTML Background Sound element (<bgsound>) sets up a sound file to play in the background while the page is used; use <audio> instead.\"><code>&lt;bgsound&gt;</code></a></td>\n   <td>The Internet Explorer only <strong>HTML Background Sound element</strong> (<strong><code>&lt;bgsound&gt;</code></strong>) sets up a sound file to play in the background while the page is used; use <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> instead.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/big\" title=\"The obsolete HTML Big Element (<big>) renders the enclosed text at a font size one level larger than the surrounding text (medium becomes large, for example).\"><code>&lt;big&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Big Element</strong> (<strong><code>&lt;big&gt;</code></strong>) renders the enclosed text at a font size one level larger than the surrounding text (<code>medium</code> becomes <code>large</code>, for example).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/blink\" title=\"The HTML Blink Element (<blink>) is a non-standard element which causes the enclosed text to flash slowly.\"><code>&lt;blink&gt;</code></a></td>\n   <td>The <strong>HTML Blink Element</strong> (<code>&lt;blink&gt;</code>) is a non-standard element which causes the enclosed text to flash slowly.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/center\" title=\"The obsolete HTML Center Element (<center>) is a block-level element that displays its block-level or inline contents centered horizontally within its containing element.\"><code>&lt;center&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Center Element</strong> (<strong><code>&lt;center&gt;</code></strong>) is a <a href=\"/en-US/docs/HTML/Block-level_elements\" title=\"HTML/Block-level_elements\">block-level element</a> that displays its block-level or inline contents centered horizontally within its containing element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/command\" title=\"The HTML Command element (<command>) represents a command which the user can invoke. Commands are often used as part of a context menu or toolbar.\"><code>&lt;command&gt;</code></a></td>\n   <td>The <strong>HTML Command element</strong> (<strong><code>&lt;command&gt;</code></strong>) represents a command which the user can invoke. Commands are often used as part of a context menu or toolbar.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/content\" title=\"The HTML <content> element—an obsolete part of the Web Components suite of technologies—was used inside of Shadow DOM as an insertion point, and wasn't meant to be used in ordinary HTML.\"><code>&lt;content&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;content&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> suite of technologies—was used inside of <a href=\"/en-US/docs/Web/Web_Components/Shadow_DOM\">Shadow DOM</a> as an <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>, and wasn't meant to be used in ordinary HTML.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dir\" title=\"The obsolete HTML Directory element (<dir>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the user agent.\"><code>&lt;dir&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Directory element</strong> (<strong><code>&lt;dir&gt;</code></strong>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/element\" title=\"The obsolete HTML <element> element was part of the Web Components specification; it was intended to be used to define new custom DOM elements.\"><code>&lt;element&gt;</code></a></td>\n   <td>The obsolete <strong>HTML <code>&lt;element&gt;</code> element</strong> was part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> specification; it was intended to be used to define new custom DOM elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/font\" title=\"The HTML Font Element (<font>) defines the font size, color and face for its content.\"><code>&lt;font&gt;</code></a></td>\n   <td>The <em>HTML Font Element</em> (<code>&lt;font&gt;</code>) defines the font size, color and face for its content.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a></td>\n   <td><code>&lt;frame&gt;</code> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <a href=\"/en-US/docs/Web/HTML/Element/frameset\" title=\"<frameset> is an HTML element which is used to contain <frame> elements.\"><code>&lt;frameset&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/frameset\" title=\"<frameset> is an HTML element which is used to contain <frame> elements.\"><code>&lt;frameset&gt;</code></a></td>\n   <td><code>&lt;frameset&gt;</code> is an HTML element which is used to contain <a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a> elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/image\" title=\"The obsolete HTML Image element (<image>) is an obsolete remnant of an ancient version of HTML lost in the mists of time; use the standard <img> element instead.\"><code>&lt;image&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Image element (<code>&lt;image&gt;</code>)</strong> is an obsolete remnant of an ancient version of HTML lost in the mists of time; use the standard <a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a> element instead.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/isindex\" title=\"<isindex> is an obsolete HTML element that puts a text field in a page for querying the document.\"><code>&lt;isindex&gt;</code></a></td>\n   <td><strong><code>&lt;isindex&gt;</code></strong> is an obsolete HTML element that puts a text field in a page for querying the document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/keygen\" title=\"The HTML <keygen> element exists to facilitate generation of key material, and submission of the public key as part of an HTML form. This mechanism is designed for use with Web-based certificate management systems. It is expected that the <keygen> element will be used in an HTML form along with other information needed to construct a certificate request, and that the result of the process will be a signed certificate.\"><code>&lt;keygen&gt;</code></a></td>\n   <td>The HTML <code>&lt;keygen&gt;</code> element exists to facilitate generation of key material, and submission of the public key as part of an <a href=\"/en-US/docs/Web/Guide/HTML/Forms\">HTML form</a>. This mechanism is designed for use with Web-based certificate management systems. It is expected that the <code>&lt;keygen&gt;</code> element will be used in an HTML form along with other information needed to construct a certificate request, and that the result of the process will be a signed certificate.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/listing\" title=\"The HTML Listing Element (<listing>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML 2 standard recommended that lines shouldn't be broken when not greater than 132 characters.\"><code>&lt;listing&gt;</code></a></td>\n   <td>The <em>HTML Listing Element</em> (<code>&lt;listing&gt;</code>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML 2 standard recommended that lines shouldn't be broken when not greater than 132 characters.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/marquee\" title=\"The HTML <marquee> element is used to insert a scrolling area of text. You can control what happens when the text reaches the edges of its content area using its attributes.\"><code>&lt;marquee&gt;</code></a></td>\n   <td>The HTML <code>&lt;marquee&gt;</code> element is used to insert a scrolling area of text. You can control what happens when the text reaches the edges of its content area using its attributes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menuitem\" title=\"The HTML <menuitem> element represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.\"><code>&lt;menuitem&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menuitem&gt;</code> element</strong> represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/multicol\" title=\"The HTML Multi-Column Layout element (<multicol>) was an experimental element designed to allow multi-column layouts and must not be used.\"><code>&lt;multicol&gt;</code></a></td>\n   <td>The <strong>HTML Multi-Column Layout element</strong> (<strong><code>&lt;multicol&gt;</code></strong>) was an experimental element designed to allow multi-column layouts and must not be used.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nextid\" title=\"<nextid> is an obsolete HTML element that served to enable the NeXT web designing tool to generate automatic NAME labels for its anchors.\"><code>&lt;nextid&gt;</code></a></td>\n   <td><strong><code>&lt;nextid&gt;</code></strong> is an obsolete HTML element that served to enable the NeXT web designing tool to generate automatic NAME labels for its anchors.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nobr\" title=\"The non-standard, obsolete HTML <nobr> element prevents the text it contains from automatically wrapping across multiple lines, potentially resulting in the user having to scroll horizontally to see the entire width of the text.\"><code>&lt;nobr&gt;</code></a></td>\n   <td>The non-standard, obsolete HTML <code>&lt;nobr&gt;</code> element prevents the text it contains from automatically wrapping across multiple lines, potentially resulting in the user having to scroll horizontally to see the entire width of the text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noembed\" title=\"The <noembed> element is an obsolete, non-standard way to provide alternative, or &quot;fallback&quot;, content for browsers that do not support the <embed> element or do not support the type of embedded content an author wishes to use.\"><code>&lt;noembed&gt;</code></a></td>\n   <td>The <code><strong>&lt;noembed&gt;</strong></code> element is an obsolete, non-standard way to provide alternative, or \"fallback\", content for browsers that do not support the <a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a> element or do not support the type of <a href=\"/en-US/docs/Web/Guide/HTML/Content_categories#Embedded_content\">embedded content</a> an author wishes to use.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noframes\" title=\"The obsolete HTML No Frames or frame fallback element, <noframes>, provides content to be presented in browsers that don't support (or have disabled support for) the <frame> element.\"><code>&lt;noframes&gt;</code></a></td>\n   <td>The obsolete HTML <strong>No Frames</strong> or <strong>frame fallback</strong> element, <strong><code>&lt;noframes&gt;</code></strong>, provides content to be presented in browsers that don't support (or have disabled support for) the <a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/plaintext\" title=\"The HTML Plaintext Element (<plaintext>) renders everything following the start tag as raw text, without interpreting any HTML. There is no closing tag, since everything after it is considered raw text.\"><code>&lt;plaintext&gt;</code></a></td>\n   <td>The <em>HTML Plaintext Element</em> (<code>&lt;plaintext&gt;</code>) renders everything following the start tag as raw text, without interpreting any HTML. There is no closing tag, since everything after it is considered raw text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/shadow\" title=\"The HTML <shadow> element—an obsolete part of the Web Components technology suite—was intended to be used as a shadow DOM insertion point.\"><code>&lt;shadow&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;shadow&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—was intended to be used as a shadow DOM <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/spacer\" title=\"<spacer> is an obsolete HTML element which allowed insertion of empty spaces on pages. It was devised by Netscape to accomplish the same effect as a single-pixel layout image, which was something web designers used to use to add white spaces to web pages without actually using an image. However, <spacer> no longer supported by any major browser and the same effects can now be achieved using simple CSS. \"><code>&lt;spacer&gt;</code></a></td>\n   <td><strong><code>&lt;spacer&gt;</code></strong> is an obsolete HTML element which allowed insertion of empty spaces on pages. It was devised by Netscape to accomplish the same effect as a single-pixel layout image, which was something web designers used to use to add white spaces to web pages without actually using an image. However, <code>&lt;spacer&gt;</code> no longer supported by any major browser and the same effects can now be achieved using simple CSS. </td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/strike\" title=\"The HTML <strike> element&nbsp;(or&nbsp;HTML Strikethrough Element) places&nbsp;a strikethrough (horizontal line) over text.\"><code>&lt;strike&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;strike&gt;</code> element</strong>&nbsp;(or&nbsp;<em>HTML Strikethrough Element</em>) places&nbsp;a strikethrough (horizontal line) over text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tt\" title=\"The obsolete HTML Teletype Text element (<tt>) creates inline text which is presented using the user agent's default monospace font face.\"><code>&lt;tt&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Teletype Text element</strong> (<strong><code>&lt;tt&gt;</code></strong>) creates inline text which is presented using the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent's: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent's</a> default monospace font face.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/xmp\" title=\"The HTML Example Element (<xmp>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML2 specification recommended that it should be rendered wide enough to allow 80 characters per line.\"><code>&lt;xmp&gt;</code></a></td>\n   <td>The <em>HTML Example Element</em> (<code>&lt;xmp&gt;</code>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML2 specification recommended that it should be rendered wide enough to allow 80 characters per line.</td>\n  </tr>\n\n </tbody>\n",
   
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/html\" title=\"The HTML <html> element represents the root (top-level element) of an HTML document, so it is also referred to as the root element. All other elements must be descendants of this element.\"><code>&lt;html&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;html&gt;</code> element</strong> represents the root (top-level element) of an HTML document, so it is also referred to as the <em>root element</em>. All other elements must be descendants of this element.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/link\" title=\"The HTML External Resource Link element (<link>) specifies relationships between the current document and an external resource. This element is most commonly used to link to stylesheets, but is also used to establish site icons (both &quot;favicon&quot; style icons and mobile home screen/app icons) among other things.\"><code>&lt;link&gt;</code></a></td>\n   <td>The <strong>HTML External Resource Link element (<code>&lt;link&gt;</code>)</strong> specifies relationships between the current document and an external resource. This element is most commonly used to link to <a href=\"/en-US/docs/Glossary/CSS\" title=\"Cascading Style Sheets\">stylesheets</a>, but is also used to establish site icons (both \"favicon\" style icons and mobile home screen/app icons) among other things.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/meta\" title=\"The HTML <meta> element represents metadata that cannot be represented by other HTML meta-related elements, like <base>, <link>, <script>, <style> or <title>.\"><code>&lt;meta&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;meta&gt;</code> element</strong> represents <a href=\"/en-US/docs/Glossary/Metadata\" class=\"glossaryLink\" title=\"metadata: Metadata is — in its very simplest definition — data that describes data. For example, an HTML document is data, but HTML can also contain metadata in its <head> element that describes the document — for example who wrote it, and its summary.\">metadata</a> that cannot be represented by other HTML meta-related elements, like <a href=\"/en-US/docs/Web/HTML/Element/base\" title=\"The HTML <base> element specifies the base URL to use for all relative URLs contained within a document. There can be only one <base> element in a document.\"><code>&lt;base&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/link\" title=\"The HTML <link> element specifies relationships between the current document and an external resource. This element is most commonly used to link to stylesheets.\"><code>&lt;link&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/script\" title=\"The HTML <script> element is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.\"><code>&lt;script&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/style\" title=\"The HTML <style> element contains style information for a document, or part of a document.\"><code>&lt;style&gt;</code></a> or <a href=\"/en-US/docs/Web/HTML/Element/title\" title=\"The HTML Title element (<title>) defines the document's title that is shown in a browser's title bar or a page's tab.\"><code>&lt;title&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/style\" title=\"The HTML <style> element contains style information for a document, or part of a document.\"><code>&lt;style&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;style&gt;</code> element</strong> contains style information for a document, or part of a document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/title\" title=\"The HTML Title element (<title>) defines the document's title that is shown in a browser's title bar or a page's tab.\"><code>&lt;title&gt;</code></a></td>\n   <td>The <strong>HTML Title element</strong> (<strong><code>&lt;title&gt;</code></strong>) defines the document's title that is shown in a browser's title bar or a page's tab.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;body&gt;</code> Element</strong> represents the content of an HTML&nbsp;document. There can be only one <code>&lt;body&gt;</code> element in a document.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/address\" title=\"The HTML <address> element indicates that the enclosed HTML provides contact information for a person or people, or for an organization.\"><code>&lt;address&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;address&gt;</code> element</strong> indicates that the enclosed HTML provides contact information for a person or people, or for an organization.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/article\" title=\"The HTML <article> element represents a self-contained composition in a document, page, application, or site, which is intended to be independently distributable or reusable (e.g., in syndication). Examples include: a forum post, a magazine or newspaper article, or a blog entry.\"><code>&lt;article&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;article&gt;</code> element</strong> represents a self-contained composition in a document, page, application, or site, which is intended to be independently distributable or reusable (e.g., in syndication). Examples include: a forum post, a magazine or newspaper article, or a blog entry.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/aside\" title=\"The HTML <aside> element represents a portion of a document whose content is only indirectly related to the document's main content.\"><code>&lt;aside&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;aside&gt;</code> element</strong> represents a portion of a document whose content is only indirectly related to the document's main content.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/footer\" title=\"The HTML <footer> element represents a footer for its nearest sectioning content or sectioning root element. A footer typically contains information about the author of the section, copyright data or links to related documents.\"><code>&lt;footer&gt;</code></a></td>\n   <td>The<strong> HTML <code>&lt;footer&gt;</code> element</strong> represents a footer for its nearest <a href=\"/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document#Defining_Sections_in_HTML5\">sectioning content</a> or <a href=\"/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document#Sectioning_root\" title=\"Sections and Outlines of an HTML5 document#Sectioning root\">sectioning root</a> element. A footer typically contains information about the author of the section, copyright data or links to related documents.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/header\" title=\"The HTML <header> element represents introductory content, typically a group of introductory or navigational aids. It may contain some heading elements but also other elements like a logo, a search form, an author name, and so on.\"><code>&lt;header&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;header&gt;</code> element</strong> represents introductory content, typically a group of introductory or navigational aids. It may contain some heading elements but also other elements like a logo, a search form, an author name, and so on.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/h1\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h1&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h2\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h2&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h3\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h3&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h4\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h4&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h5\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h5&gt;</code></a>, <a href=\"/en-US/docs/Web/HTML/Element/h6\" title=\"Heading elements implement six levels of document headings, <h1> is the most important and <h6> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically.\"><code>&lt;h6&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;h1&gt;</code>–<code>&lt;h6&gt;</code> elements</strong> represent six levels of section headings. <code>&lt;h1&gt;</code> is the highest section level and <code>&lt;h6&gt;</code> is the lowest.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/hgroup\" title=\"The HTML <hgroup> element represents a multi-level heading for a section of a document. It groups a set of <h1>–<h6> elements.\"><code>&lt;hgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;hgroup&gt;</code> element</strong> represents a multi-level heading for a section of a document. It groups a set of <code><a href=\"/en-US/docs/Web/HTML/Element/Heading_Elements\">&lt;h1&gt;–&lt;h6&gt;</a></code> elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/main\" title=\"The HTML <main> element represents the dominant content of&nbsp;the <body> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.\"><code>&lt;main&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;main&gt;</code> element</strong> represents the dominant content of&nbsp;the <a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nav\" title=\"The HTML <nav> element represents a section of a page whose purpose is to provide navigation links, either within the current document or to other documents. Common examples of navigation sections are menus, tables of contents, and indexes.\"><code>&lt;nav&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;nav&gt;</code> element</strong> represents a section of a page whose purpose is to provide navigation links, either within the current document or to other documents. Common examples of navigation sections are menus, tables of contents, and indexes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/section\" title=\"The HTML <section> element represents a standalone section — which doesn't have a more specific semantic element to represent it — contained within an HTML document.\"><code>&lt;section&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;section&gt;</code> element</strong> represents a standalone section — which doesn't have a more specific semantic element to represent it — contained within an HTML document.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/blockquote\" title=\"The HTML <blockquote> Element (or HTML Block Quotation Element) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see Notes for how to change it). A URL for the source of the quotation may be given using the cite attribute, while a text representation of the source can be given using the <cite> element.\"><code>&lt;blockquote&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;blockquote&gt;</code> Element</strong> (or <em>HTML Block Quotation Element</em>) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see <a rel=\"internal\" href=\"#Usage_notes\">Notes</a> for how to change it). A URL for the source of the quotation may be given using the <strong>cite</strong> attribute, while a text representation of the source can be given using the <a href=\"/en-US/docs/Web/HTML/Element/cite\" title=\"The HTML Citation element (<cite>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.\"><code>&lt;cite&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dd\" title=\"The&nbsp;HTML <dd> element provides the details about or the definition of the preceding term (<dt>) in a description list (<dl>).\"><code>&lt;dd&gt;</code></a></td>\n   <td>The&nbsp;<strong>HTML <code>&lt;dd&gt;</code> element</strong> provides the details about or the definition of the preceding term (<a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a>) in a description list (<a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a>).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dir\" title=\"The obsolete HTML Directory element (<dir>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the user agent.\"><code>&lt;dir&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Directory element</strong> (<strong><code>&lt;dir&gt;</code></strong>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/div\" title=\"The HTML Content Division element (<div>) is the generic container for flow content. It has no effect on the content or layout until styled using CSS.\"><code>&lt;div&gt;</code></a></td>\n   <td>The <strong>HTML Content Division element</strong> (<strong><code>&lt;div&gt;</code></strong>) is the generic container for flow content. It has no effect on the content or layout until styled using CSS.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dl&gt;</code>&nbsp;</strong>element represents a description list.<strong>&nbsp;</strong>The element encloses a list of groups of terms (specified using the <a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a> element) and descriptions (provided by <a href=\"/en-US/docs/Web/HTML/Element/dd\" title=\"The&nbsp;HTML <dd> element provides the details about or the definition of the preceding term (<dt>) in a description list (<dl>).\"><code>&lt;dd&gt;</code></a> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dt\" title=\"The HTML <dt> element specifies a term in a description or definition list, and as such must be used inside a <dl> element.\"><code>&lt;dt&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dt&gt;</code> element</strong> specifies a term in a description or definition list, and as such must be used inside a <a href=\"/en-US/docs/Web/HTML/Element/dl\" title=\"The HTML <dl>&nbsp;element represents a description list.&nbsp;The element encloses a list of groups of terms (specified using the <dt> element) and descriptions (provided by <dd> elements). Common uses for this element are to implement a glossary or to display metadata (a list of key-value pairs).\"><code>&lt;dl&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/figcaption\" title=\"The HTML <figcaption> element represents a caption or legend for the rest of the contents its parent <figure> element, if any.\"><code>&lt;figcaption&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;figcaption&gt;</code> element</strong> represents a caption or legend for the rest of the contents its parent <a href=\"/en-US/docs/Web/HTML/Element/figure\" title=\"The HTML <figure> element represents self-contained content, frequently with a caption (<figcaption>), and is typically referenced as a single unit.\"><code>&lt;figure&gt;</code></a> element, if any.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/figure\" title=\"The HTML <figure> element represents self-contained content, frequently with a caption (<figcaption>), and is typically referenced as a single unit.\"><code>&lt;figure&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;figure&gt;</code> element</strong> represents self-contained content, frequently with a caption (<a href=\"/en-US/docs/Web/HTML/Element/figcaption\" title=\"The HTML <figcaption> element represents a caption or legend for the rest of the contents its parent <figure> element, if any.\"><code>&lt;figcaption&gt;</code></a>), and is typically referenced as a single unit.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/hr\" title=\"The HTML <hr> element represents a thematic break between paragraph-level elements (for example, a change of scene in a story, or a shift of topic with a section); historically, this has been presented as a horizontal rule or line.\"><code>&lt;hr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;hr&gt;</code> element</strong> represents a thematic break between paragraph-level elements (for example, a change of scene in a story, or a shift of topic with a section); historically, this has been presented as a horizontal rule or line.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/li\" title=\"The HTML <li> element is used to represent an item in a list. It must be contained in a parent element: an ordered list (<ol>), an unordered list (<ul>), or a menu (<menu>). In menus and unordered lists, list items are usually displayed using bullet points. In ordered lists, they are usually displayed with an ascending counter on the left, such as a number or letter.\"><code>&lt;li&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;li&gt;</code> element</strong> is used to represent an item in a list. It must be contained in a parent element: an ordered list (<a href=\"/en-US/docs/Web/HTML/Element/ol\" title=\"The HTML <ol> element represents an ordered list of items, typically rendered as a numbered list.\"><code>&lt;ol&gt;</code></a>), an unordered list (<a href=\"/en-US/docs/Web/HTML/Element/ul\" title=\"The HTML <ul> element represents an unordered list of items, typically rendered as a bulleted list.\"><code>&lt;ul&gt;</code></a>), or a menu (<a href=\"/en-US/docs/Web/HTML/Element/menu\" title=\"The HTML <menu> element represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.\"><code>&lt;menu&gt;</code></a>). In menus and unordered lists, list items are usually displayed using bullet points. In ordered lists, they are usually displayed with an ascending counter on the left, such as a number or letter.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/main\" title=\"The HTML <main> element represents the dominant content of&nbsp;the <body> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.\"><code>&lt;main&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;main&gt;</code> element</strong> represents the dominant content of&nbsp;the <a href=\"/en-US/docs/Web/HTML/Element/body\" title=\"The HTML <body> Element represents the content of an HTML&nbsp;document. There can be only one <body> element in a document.\"><code>&lt;body&gt;</code></a> of a document, portion of a document&nbsp;or application. The main content area consists of content that is directly related to&nbsp;or expands upon the central topic of&nbsp;a document, or the central functionality of an application.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ol\" title=\"The HTML <ol> element represents an ordered list of items, typically rendered as a numbered list.\"><code>&lt;ol&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ol&gt;</code> element</strong> represents an ordered list of items, typically rendered as a numbered list.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/p\" title=\"The HTML <p> element represents a paragraph of text.\"><code>&lt;p&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;p&gt;</code> element</strong> represents a paragraph of text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/pre\" title=\"The HTML <pre> element represents preformatted text which is to be presented exactly as written in the HTML file.\"><code>&lt;pre&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;pre&gt;</code> element</strong> represents preformatted text which is to be presented exactly as written in the HTML file.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ul\" title=\"The HTML <ul> element represents an unordered list of items, typically rendered as a bulleted list.\"><code>&lt;ul&gt;</code></a></td>\n   <td>The<strong> HTML <code>&lt;ul&gt;</code> element</strong> represents an unordered list of items, typically rendered as a bulleted list.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/a\" title=\"The HTML <a> element (or anchor element) creates a hyperlink to other web pages, files, locations within the same page, email addresses, or any other URL.\"><code>&lt;a&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;a&gt;</code> element</strong> (or <em>anchor</em> element) creates a hyperlink to other web pages, files, locations within the same page, email addresses, or any other URL.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/abbr\" title=\"The HTML Abbreviation element (<abbr>) represents an abbreviation or acronym; the optional title attribute can provide an expansion or description for the abbreviation.\"><code>&lt;abbr&gt;</code></a></td>\n   <td>The <strong>HTML Abbreviation element </strong>(<strong><code>&lt;abbr&gt;</code></strong>) represents an abbreviation or acronym; the optional <code><a href=\"/en-US/docs/Web/HTML/Global_attributes#attr-title\">title</a></code> attribute can provide an expansion or description for the abbreviation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/b\" title=\"The HTML Bring Attention To element (<b>)&nbsp; is used to draw the reader's attention to the element's contents, which are not otherwise granted special importance.\"><code>&lt;b&gt;</code></a></td>\n   <td>The <strong>HTML Bring Attention To element</strong> (<strong><code>&lt;b&gt;</code></strong>)&nbsp; is used to draw the reader's attention to the element's contents, which are not otherwise granted special importance.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bdi\" title=\"The HTML BiDirectional Isolation element (<bdi>)&nbsp; is used to indicate spans of text which might need to be rendered in the opposite direction than the surrounding text.\"><code>&lt;bdi&gt;</code></a></td>\n   <td>The HTML <strong>BiDirectional Isolation element</strong> (<strong><code>&lt;bdi&gt;</code></strong>)&nbsp; is used to indicate spans of text which might need to be rendered in the opposite direction than the surrounding text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bdo\" title=\"The HTML Bidirectional Text Override element (<bdo>) overrides the current directionality of text, so that the text within is rendered in a different direction.\"><code>&lt;bdo&gt;</code></a></td>\n   <td>The <strong>HTML Bidirectional Text Override element</strong> (<strong><code>&lt;bdo&gt;</code></strong>) overrides the current directionality of text, so that the text within is rendered in a different direction.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/br\" title=\"The HTML <br> element produces a line break in text (carriage-return). It is useful for writing a poem or an address, where the division of lines is significant.\"><code>&lt;br&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;br&gt;</code> element</strong> produces a line break in text (carriage-return). It is useful for writing a poem or an address, where the division of lines is significant.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/cite\" title=\"The HTML Citation element (<cite>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.\"><code>&lt;cite&gt;</code></a></td>\n   <td>The <strong>HTML Citation element</strong> (<strong><code>&lt;cite&gt;</code></strong>) is used to describe a reference to a cited creative work, and must include either the title or author or the URL of that work.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/code\" title=\"The HTML <code> element displays its contents styled in a fashion intended to indicate that the text is a short fragment of computer code.\"><code>&lt;code&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;code&gt;</code> element</strong> displays its contents styled in a fashion intended to indicate that the text is a short fragment of computer code.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/data\" title=\"The HTML <data> element links a given content with a machine-readable translation. If the content is time- or date-related, the <time> element must be used.\"><code>&lt;data&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;data&gt;</code> element</strong> links a given content with a machine-readable translation. If the content is time- or date-related, the <a href=\"/en-US/docs/Web/HTML/Element/time\" title=\"The HTML <time> element represents a specific period in time. It may include the&nbsp;datetime&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.\"><code>&lt;time&gt;</code></a> element must be used.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dfn\" title=\"The HTML Definition element (<dfn>) is used to indicate the term being defined within the context of a definition phrase or sentence.\"><code>&lt;dfn&gt;</code></a></td>\n   <td>The <strong>HTML Definition element</strong> (<strong><dfn>&lt;dfn&gt;</dfn></strong>) is used to indicate the term being defined within the context of a definition phrase or sentence.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/em\" title=\"The HTML <em> element marks text that has stress emphasis. The <em> element can be nested, with each level of nesting indicating a greater degree of emphasis.\"><code>&lt;em&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;em&gt;</code> element</strong> marks text that has stress emphasis. The <code>&lt;em&gt;</code> element can be nested, with each level of nesting indicating a greater degree of emphasis.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/i\" title=\"The HTML <i> element represents a range of text that is set off from the normal text for some reason. Some examples include technical terms, foreign language phrases, or fictional character thoughts. It is typically displayed in italic type.\"><code>&lt;i&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;i&gt;</code> element</strong> represents a range of text that is set off from the normal text for some reason. Some examples include technical terms, foreign language phrases, or fictional character thoughts. It is typically displayed in italic type.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/kbd\" title=\"The HTML Keyboard Input element (<kbd>) represents a span of inline text denoting textual user input from a keyboard, voice input, or any other text entry device.\"><code>&lt;kbd&gt;</code></a></td>\n   <td>The <strong>HTML Keyboard Input element</strong> (<strong><code>&lt;kbd&gt;</code></strong>) represents a span of inline text denoting textual user input from a keyboard, voice input, or any other text entry device.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/mark\" title=\"The HTML Mark Text element (<mark>) represents text which is marked or highlighted for reference or notation purposes, due to the marked passage's relevance or importance in the enclosing context.\"><code>&lt;mark&gt;</code></a></td>\n   <td>The <strong>HTML Mark Text element</strong> (<strong><code>&lt;mark&gt;</code></strong>) represents text which is <strong>marked</strong> or <strong>highlighted</strong> for reference or notation purposes, due to the marked passage's relevance or importance in the enclosing context.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/q\" title=\"The HTML <q> element  indicates that the enclosed text is a short inline quotation. Most modern browsers implement this by surrounding the text in quotation marks. \"><code>&lt;q&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;q&gt;</code> element </strong> indicates that the enclosed text is a short inline quotation. Most modern browsers implement this by surrounding the text in quotation marks. </td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Base (<code>&lt;rb&gt;</code>) element</strong> is used to delimit the base text component of a&nbsp; <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> annotation, i.e. the text that is being annotated.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rp\" title=\"The HTML Ruby Fallback Parenthesis (<rp>) element is used to provide fall-back parentheses for browsers that do not support display of ruby annotations using the <ruby> element.\"><code>&lt;rp&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Fallback Parenthesis (<code>&lt;rp&gt;</code>) element</strong> is used to provide fall-back parentheses for browsers that do not support display of ruby annotations using the <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rt\" title=\"The HTML Ruby Text (<rt>) element specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <rt> element must always be contained within a <ruby> element.\"><code>&lt;rt&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Text (<code>&lt;rt&gt;</code>) element</strong> specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <code>&lt;rt&gt;</code> element must always be contained within a <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/rtc\" title=\"The HTML Ruby Text Container (<rtc>) element embraces semantic annotations of characters presented in a ruby of <rb> elements used inside of <ruby> element. <rb> elements can have both pronunciation (<rt>) and semantic (<rtc>) annotations.\"><code>&lt;rtc&gt;</code></a></td>\n   <td>The <strong>HTML Ruby Text Container (<code>&lt;rtc&gt;</code>) element</strong> embraces semantic annotations of characters presented in a ruby of <a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a> elements used inside of <a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a> element. <a href=\"/en-US/docs/Web/HTML/Element/rb\" title=\"The HTML Ruby Base (<rb>) element is used to delimit the base text component of a&nbsp; <ruby> annotation, i.e. the text that is being annotated.\"><code>&lt;rb&gt;</code></a> elements can have both pronunciation (<a href=\"/en-US/docs/Web/HTML/Element/rt\" title=\"The HTML Ruby Text (<rt>) element specifies the ruby text component of a ruby annotation, which is used to provide pronunciation, translation, or transliteration information for East Asian typography. The <rt> element must always be contained within a <ruby> element.\"><code>&lt;rt&gt;</code></a>) and semantic (<a href=\"/en-US/docs/Web/HTML/Element/rtc\" title=\"The HTML Ruby Text Container (<rtc>) element embraces semantic annotations of characters presented in a ruby of <rb> elements used inside of <ruby> element. <rb> elements can have both pronunciation (<rt>) and semantic (<rtc>) annotations.\"><code>&lt;rtc&gt;</code></a>) annotations.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ruby\" title=\"The HTML <ruby> element represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.\"><code>&lt;ruby&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ruby&gt;</code> element</strong> represents a ruby annotation. Ruby annotations are for showing pronunciation of East Asian characters.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/s\" title=\"The HTML <s> element renders text with a strikethrough, or a line through it. Use the <s> element to represent things that are no longer relevant or no longer accurate. However, <s> is not appropriate when indicating document edits; for that, use the <del> and <ins> elements, as appropriate.\"><code>&lt;s&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;s&gt;</code> element</strong> renders text with a strikethrough, or a line through it. Use the <code>&lt;s&gt;</code> element to represent things that are no longer relevant or no longer accurate. However, <code>&lt;s&gt;</code> is not appropriate when indicating document edits; for that, use the <a href=\"/en-US/docs/Web/HTML/Element/del\" title=\"The HTML <del> element represents a range of text that has been deleted from a document.\"><code>&lt;del&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/ins\" title=\"The HTML <ins> element represents a range of text that has been added to a document.\"><code>&lt;ins&gt;</code></a> elements, as appropriate.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/samp\" title=\"The HTML Sample Element (<samp>) is used to enclose inline text which represents sample (or quoted) output from a computer program.\"><code>&lt;samp&gt;</code></a></td>\n   <td>The <strong>HTML Sample Element</strong> (<strong><code>&lt;samp&gt;</code></strong>) is used to enclose inline text which represents sample (or quoted) output from a computer program.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/small\" title=\"The HTML <small> element makes the text font size one size smaller (for example, from large to medium, or from small to x-small) down to the browser's minimum font size.&nbsp; In HTML5, this element is repurposed to represent side-comments and small print, including copyright and legal text, independent of its styled presentation.\"><code>&lt;small&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;small&gt;</code></strong> <strong>element </strong>makes the text <em>font size</em> one size smaller (for example, from large to medium, or from small to x-small) down to the browser's minimum font size.&nbsp; In HTML5, this element is repurposed to represent side-comments and small print, including copyright and legal text, independent of its styled presentation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/span\" title=\"The HTML <span> element is a generic inline container for phrasing content, which does not inherently represent anything. It can be used to group elements for styling purposes (using the class or id attributes), or because they share attribute values, such as lang.\"><code>&lt;span&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;span&gt;</code> element</strong> is a generic inline container for phrasing content, which does not inherently represent anything. It can be used to group elements for styling purposes (using the <code>class</code> or <code>id</code> attributes), or because they share attribute values, such as <code>lang</code>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/strong\" title=\"The HTML Strong Importance Element (<strong>) indicates that its contents have strong importance, seriousness, or urgency. Browsers typically render the contents in bold type.\"><code>&lt;strong&gt;</code></a></td>\n   <td>The HTML <strong>Strong Importance Element</strong> (<strong><code>&lt;strong&gt;</code>)</strong> indicates that its contents have strong importance, seriousness, or urgency. Browsers typically render the contents in bold type.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/sub\" title=\"The HTML Subscript element (<sub>) specifies inline text which should be displayed as subscript for solely typographical reasons.\"><code>&lt;sub&gt;</code></a></td>\n   <td>The <strong>HTML Subscript element</strong> (<strong><code>&lt;sub&gt;</code></strong>) specifies inline text which should be displayed as subscript for solely typographical reasons.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/sup\" title=\"The HTML Superscript element (<sup>) specifies inline text which is to be displayed as superscript for solely typographical reasons.\"><code>&lt;sup&gt;</code></a></td>\n   <td>The <strong>HTML Superscript element</strong> (<strong><code>&lt;sup&gt;</code></strong>) specifies inline text which is to be displayed as superscript for solely typographical reasons.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/time\" title=\"The HTML <time> element represents a specific period in time. It may include the&nbsp;datetime&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.\"><code>&lt;time&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;time&gt;</code> element</strong> represents a specific period in time. It may include the&nbsp;<strong>datetime</strong>&nbsp;attribute to translate dates into machine-readable format, allowing for better search engine results or custom features such as reminders.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tt\" title=\"The obsolete HTML Teletype Text element (<tt>) creates inline text which is presented using the user agent's default monospace font face.\"><code>&lt;tt&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Teletype Text element</strong> (<strong><code>&lt;tt&gt;</code></strong>) creates inline text which is presented using the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent's: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent's</a> default monospace font face.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/u\" title=\"The HTML Unarticulated Annotation element (<u>) represents a span of inline text which should be rendered in a way that indicates that it has a non-textual annotation.\"><code>&lt;u&gt;</code></a></td>\n   <td>The <strong>HTML Unarticulated Annotation</strong> element (<strong><code>&lt;u&gt;</code></strong>) represents a span of inline text which should be rendered in a way that indicates that it has a non-textual annotation.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/var\" title=\"The HTML Variable element (<var>) represents the name of a variable in a mathematical expression or a programming context.\"><code>&lt;var&gt;</code></a></td>\n   <td>The <strong>HTML Variable element</strong> (<strong><code>&lt;var&gt;</code></strong>) represents the name of a variable in a mathematical expression or a programming context.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/wbr\" title=\"The HTML <wbr> element represents a word break opportunity—a position within text where the browser may optionally break a line, though its line-breaking rules would not otherwise create a break at that location.\"><code>&lt;wbr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;wbr&gt;</code> element</strong> represents a word break opportunity—a position within text where the browser may optionally break a line, though its line-breaking rules would not otherwise create a break at that location.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/area\" title=\"The HTML <area> element defines a hot-spot region on an image, and optionally associates it with a hypertext link. This element is used only within a <map> element.\"><code>&lt;area&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;area&gt;</code> element</strong> defines a hot-spot region on an image, and optionally associates it with a <a href=\"/en-US/docs/Glossary/Hyperlink\" class=\"glossaryLink\" title=\"hypertext link: Hyperlinks connect webpages or data items to one another. In HTML, <a> elements define hyperlinks from a spot on a webpage (like a text string or image) to another spot on some other webpage (or even on the same page).\">hypertext link</a>. This element is used only within a <a href=\"/en-US/docs/Web/HTML/Element/map\" title=\"The HTML <map> element is used with <area> elements to define an image map (a clickable link area).\"><code>&lt;map&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;audio&gt;</code> element</strong> is used to embed sound content in documents. It may contain one or more audio sources, represented using the <code>src</code> attribute or the <a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a <a href=\"/en-US/docs/Web/API/MediaStream\" title=\"The MediaStream interface represents a stream of media content. A stream consists of several tracks such as&nbsp;video or audio tracks. Each track is specified as an instance of MediaStreamTrack.\"><code>MediaStream</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;img&gt;</code> element</strong> embeds an image into the document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/map\" title=\"The HTML <map> element is used with <area> elements to define an image map (a clickable link area).\"><code>&lt;map&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;map&gt;</code> element</strong> is used with <a href=\"/en-US/docs/Web/HTML/Element/area\" title=\"The HTML <area> element defines a hot-spot region on an image, and optionally associates it with a hypertext link. This element is used only within a <map> element.\"><code>&lt;area&gt;</code></a> elements to define an image map (a clickable link area).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/track\" title=\"The HTML <track> element is used as a child of the media elements <audio> and <video>. It lets you specify timed text tracks (or time-based data), for example to automatically handle subtitles. The tracks are formatted in WebVTT format (.vtt files) — Web Video Text Tracks or&nbsp;Timed Text Markup Language (TTML).\"><code>&lt;track&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;track&gt;</code> element</strong> is used as a child of the media elements <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a>. It lets you specify timed text tracks (or time-based data), for example to automatically handle subtitles. The tracks are formatted in <a href=\"/en-US/docs/Web/API/Web_Video_Text_Tracks_Format\">WebVTT format</a> (<code>.vtt</code> files) — Web Video Text Tracks or&nbsp;<a rel=\"noopener\" href=\"https://w3c.github.io/ttml2/index.html\" class=\"external external-icon\">Timed Text Markup Language (TTML).</a></td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a></td>\n   <td>The <strong>HTML Video element</strong> (<strong><code>&lt;video&gt;</code></strong>) embeds a media player which supports video playback into the document.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/applet\" title=\"The obsolete HTML Applet Element (<applet>) embeds a Java applet into the document; this element has been deprecated in favor of <object>.\"><code>&lt;applet&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Applet Element</strong> (<strong><code>&lt;applet&gt;</code></strong>) embeds a Java applet into the document; this element has been deprecated in favor of <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;embed&gt;</code> element</strong> embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/iframe\" title=\"The HTML Inline Frame element (<iframe>) represents a nested browsing context, effectively embedding another HTML page into the current page.\"><code>&lt;iframe&gt;</code></a></td>\n   <td>The <strong>HTML Inline Frame element (<code>&lt;iframe&gt;</code>)</strong> represents a nested browsing context, effectively embedding another HTML page into the current page.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noembed\" title=\"The <noembed> element is an obsolete, non-standard way to provide alternative, or &quot;fallback&quot;, content for browsers that do not support the <embed> element or do not support the type of embedded content an author wishes to use.\"><code>&lt;noembed&gt;</code></a></td>\n   <td>The <code><strong>&lt;noembed&gt;</strong></code> element is an obsolete, non-standard way to provide alternative, or \"fallback\", content for browsers that do not support the <a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a> element or do not support the type of <a href=\"/en-US/docs/Web/Guide/HTML/Content_categories#Embedded_content\">embedded content</a> an author wishes to use.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;object&gt;</code> element</strong> represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/param\" title=\"The HTML <param> element defines parameters for an <object> element.\"><code>&lt;param&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;param&gt;</code> element</strong> defines parameters for an <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/picture\" title=\"The HTML <picture> element serves as a container for zero or more <source> elements and one <img> element to provide versions of an image for different display device scenarios.\"><code>&lt;picture&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;picture&gt;</code> element</strong> serves as a container for zero or more <a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a> elements and one <a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a> element to provide versions of an image for different display device scenarios.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/source\" title=\"The HTML <source> element specifies multiple media resources for the <picture>, the <audio> element, or the <video> element. It is an empty element. It is commonly used to serve the same media content in multiple formats supported by different browsers.\"><code>&lt;source&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;source&gt;</code> element</strong> specifies multiple media resources for the <a href=\"/en-US/docs/Web/HTML/Element/picture\" title=\"The HTML <picture> element serves as a container for zero or more <source> elements and one <img> element to provide versions of an image for different display device scenarios.\"><code>&lt;picture&gt;</code></a>, the <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> element, or the <a href=\"/en-US/docs/Web/HTML/Element/video\" title=\"The HTML Video element (<video>) embeds a media player which supports video playback into the document.\"><code>&lt;video&gt;</code></a> element. It is an empty element. It is commonly used to serve the same media content in <a href=\"/en-US/docs/Media_formats_supported_by_the_audio_and_video_elements\">multiple formats supported by different browsers</a>.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/canvas\" title=\"Use the HTML <canvas> element with either the canvas scripting API or the WebGL API to draw graphics and animations.\"><code>&lt;canvas&gt;</code></a></td>\n   <td>Use the <strong>HTML <code>&lt;canvas&gt;</code> element</strong> with either the <a href=\"/en-US/docs/Web/API/Canvas_API\">canvas scripting API</a> or the <a href=\"/en-US/docs/Web/API/WebGL_API\">WebGL API</a> to draw graphics and animations.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noscript\" title=\"The HTML <noscript> element defines a section of HTML to be inserted if a script type on the page is unsupported or if scripting is currently turned off in the browser.\"><code>&lt;noscript&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;noscript&gt;</code> element</strong> defines a section of HTML to be inserted if a script type on the page is unsupported or if scripting is currently turned off in the browser.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/script\" title=\"The HTML <script> element is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.\"><code>&lt;script&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;script&gt;</code> element</strong> is used to embed or reference executable code; this is typically used to embed or refer to JavaScript code.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/del\" title=\"The HTML <del> element represents a range of text that has been deleted from a document.\"><code>&lt;del&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;del&gt;</code> element</strong> represents a range of text that has been deleted from a document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/ins\" title=\"The HTML <ins> element represents a range of text that has been added to a document.\"><code>&lt;ins&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;ins&gt;</code> element</strong> represents a range of text that has been added to a document.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/caption\" title=\"The HTML Table Caption element (<caption>) specifies the caption (or title) of a table, and if used is always the first child of a <table>.\"><code>&lt;caption&gt;</code></a></td>\n   <td>The <strong>HTML Table Caption element</strong> (<strong><code>&lt;caption&gt;</code></strong>) specifies the caption (or title) of a table, and if used is <em>always</em> the first child of a <a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/col\" title=\"The HTML <col> element defines a column within a table and is used for defining common semantics on all common cells. It is generally found within a <colgroup> element.\"><code>&lt;col&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;col&gt;</code> element</strong> defines a column within a table and is used for defining common semantics on all common cells. It is generally found within a <a href=\"/en-US/docs/Web/HTML/Element/colgroup\" title=\"The HTML <colgroup> element defines a group of columns within a table.\"><code>&lt;colgroup&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/colgroup\" title=\"The HTML <colgroup> element defines a group of columns within a table.\"><code>&lt;colgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;colgroup&gt;</code> element</strong> defines a group of columns within a table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;table&gt;</code> element</strong> represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tbody\" title=\"The HTML Table Body element (<tbody>) encapsulates a set of table row (<tr> elements, indicating that they comprise the body of the table (<table>).\"><code>&lt;tbody&gt;</code></a></td>\n   <td>The <strong>HTML Table Body element</strong> (<strong><code>&lt;tbody&gt;</code></strong>) encapsulates a set of table row (<a href=\"/en-US/docs/Web/HTML/Element/tr\" title=\"The HTML <tr> element defines a row of cells in a table. The row's cells can then be established using a mix of <td> (data cell) and <th> (header cell) elements.The HTML <tr> element specifies that the markup contained inside the <tr> block comprises one row of a table, inside which the <th> and <td> elements create header and data cells, respectively, within the row.\"><code>&lt;tr&gt;</code></a> elements, indicating that they comprise the body of the table (<a href=\"/en-US/docs/Web/HTML/Element/table\" title=\"The HTML <table> element represents tabular data — that is, information presented in a two-dimensional table comprised of rows and columns of cells containing data.\"><code>&lt;table&gt;</code></a>).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;td&gt;</code> element</strong> defines a cell of a table that contains data. It participates in the <em>table model</em>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tfoot\" title=\"The HTML <tfoot> element defines a set of rows summarizing the columns of the table.\"><code>&lt;tfoot&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;tfoot&gt;</code> element</strong> defines a set of rows summarizing the columns of the table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML <th> element defines a cell as header of a group of table cells. The exact nature of this group is defined by the scope and headers attributes.\"><code>&lt;th&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;th&gt;</code> element</strong> defines a cell as header of a group of table cells. The exact nature of this group is defined by the <code><a href=\"/en-US/docs/Web/HTML/Element/th#attr-scope\">scope</a></code> and <code><a href=\"/en-US/docs/Web/HTML/Element/th#attr-headers\">headers</a></code> attributes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/thead\" title=\"The HTML <thead> element defines a set of rows defining the head of the columns of the table.\"><code>&lt;thead&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;thead&gt;</code> element</strong> defines a set of rows defining the head of the columns of the table.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tr\" title=\"The HTML <tr> element defines a row of cells in a table. The row's cells can then be established using a mix of <td> (data cell) and <th> (header cell) elements.The HTML <tr> element specifies that the markup contained inside the <tr> block comprises one row of a table, inside which the <th> and <td> elements create header and data cells, respectively, within the row.\"><code>&lt;tr&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;tr&gt;</code> element</strong> defines a row of cells in a table. The row's cells can then be established using a mix of <a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a> (data cell) and <a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML &amp;lt;th&amp;gt; element defines a cell as header of a group of table cells. The exact nature of this group is defined by the {{htmlattrxref(&quot;scope&quot;, &quot;th&quot;)}} and {{htmlattrxref(&quot;headers&quot;, &quot;th&quot;)}} attributes.\"><code>&lt;th&gt;</code></a> (header cell) elements.The HTML <strong><code>&lt;tr&gt;</code></strong> element specifies that the markup contained inside the <code>&lt;tr&gt;</code> block comprises one row of a table, inside which the <a href=\"/en-US/docs/Web/HTML/Element/th\" title=\"The HTML &amp;lt;th&amp;gt; element defines a cell as header of a group of table cells. The exact nature of this group is defined by the {{htmlattrxref(&quot;scope&quot;, &quot;th&quot;)}} and {{htmlattrxref(&quot;headers&quot;, &quot;th&quot;)}} attributes.\"><code>&lt;th&gt;</code></a> and <a href=\"/en-US/docs/Web/HTML/Element/td\" title=\"The HTML <td> element defines a cell of a table that contains data. It participates in the table model.\"><code>&lt;td&gt;</code></a> elements create header and data cells, respectively, within the row.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/button\" title=\"The HTML <button> element represents a clickable button, which can be used in forms or anywhere in a document that needs simple, standard button functionality.\"><code>&lt;button&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;button&gt;</code> element</strong> represents a clickable button, which can be used in <a href=\"/en-US/docs/Learn/HTML/Forms\">forms</a> or anywhere in a document that needs simple, standard button functionality.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/datalist\" title=\"The HTML <datalist> element contains a set of <option> elements that represent the values available for other controls.\"><code>&lt;datalist&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;datalist&gt;</code> element</strong> contains a set of <a href=\"/en-US/docs/Web/HTML/Element/option\" title=\"The HTML <option> element is used to define an item contained in a <select>, an <optgroup>, or a <datalist>&nbsp;element. As such,&nbsp;<option>&nbsp;can represent menu items in popups and other lists of items in an HTML document.\"><code>&lt;option&gt;</code></a> elements that represent the values available for other controls.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/fieldset\" title=\"The HTML <fieldset> element is used to group several controls as well as labels (<label>) within a web form.\"><code>&lt;fieldset&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;fieldset&gt;</code> element</strong> is used to group several controls as well as labels (<a href=\"/en-US/docs/Web/HTML/Element/label\" title=\"The HTML <label> element represents a caption for an item in a user interface.\"><code>&lt;label&gt;</code></a>) within a web form.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/form\" title=\"The HTML <form> element represents a document section that contains interactive controls for submitting information to a web server.\"><code>&lt;form&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;form&gt;</code> element</strong> represents a document section that contains interactive controls for submitting information to a web server.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/input\" title=\"The HTML <input> element is used to create interactive controls for web-based forms in order to accept data from the user; a wide variety of types of input data and control widgets are available, depending on the device and user agent.\"><code>&lt;input&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;input&gt;</code> element</strong> is used to create interactive controls for web-based forms in order to accept data from the user; a wide variety of types of input data and control widgets are available, depending on the device and <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/label\" title=\"The HTML <label> element represents a caption for an item in a user interface.\"><code>&lt;label&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;label&gt;</code> element</strong> represents a caption for an item in a user interface.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/legend\" title=\"The HTML <legend> element represents a caption for the content of its parent <fieldset>.\"><code>&lt;legend&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;legend&gt;</code> element</strong> represents a caption for the content of its parent <a href=\"/en-US/docs/Web/HTML/Element/fieldset\" title=\"The HTML <fieldset> element is used to group several controls as well as labels (<label>) within a web form.\"><code>&lt;fieldset&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/meter\" title=\"The HTML <meter> element represents either a scalar value within a known range or a fractional value.\"><code>&lt;meter&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;meter&gt;</code> element</strong> represents either a scalar value within a known range or a fractional value.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/optgroup\" title=\"The HTML <optgroup> element creates a grouping of options within a <select> element.\"><code>&lt;optgroup&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;optgroup&gt;</code> element</strong> creates a grouping of options within a <a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/option\" title=\"The HTML <option> element is used to define an item contained in a <select>, an <optgroup>, or a <datalist>&nbsp;element. As such,&nbsp;<option>&nbsp;can represent menu items in popups and other lists of items in an HTML document.\"><code>&lt;option&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;option&gt;</code> element</strong> is used to define an item contained in a <a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a>, an <a href=\"/en-US/docs/Web/HTML/Element/optgroup\" title=\"The HTML <optgroup> element creates a grouping of options within a <select> element.\"><code>&lt;optgroup&gt;</code></a>, or a <a href=\"/en-US/docs/Web/HTML/Element/datalist\" title=\"The HTML <datalist> element contains a set of <option> elements that represent the values available for other controls.\"><code>&lt;datalist&gt;</code></a>&nbsp;element. As such,&nbsp;<code>&lt;option&gt;</code>&nbsp;can represent menu items in popups and other lists of items in an HTML document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/output\" title=\"The HTML Output element (<output>) is a container element into which a site or app can inject the results of a calculation or the outcome of a user action.\"><code>&lt;output&gt;</code></a></td>\n   <td>The <strong>HTML Output element</strong> (<strong><code>&lt;output&gt;</code></strong>) is a container element into which a site or app can inject the results of a calculation or the outcome of a user action.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/progress\" title=\"The HTML <progress> element displays an indicator showing the completion progress of a task, typically displayed as a progress bar.\"><code>&lt;progress&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;progress&gt;</code> element</strong> displays an indicator showing the completion progress of a task, typically displayed as a progress bar.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/select\" title=\"The HTML <select> element represents a control that provides a menu of options:\"><code>&lt;select&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;select&gt;</code> element</strong> represents a control that provides a menu of options:</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/textarea\" title=\"The HTML <textarea> element represents a multi-line plain-text editing control, useful when you want to allow users to enter a sizeable amount of free-form text, for example a comment on a review or feedback form.\"><code>&lt;textarea&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;textarea&gt;</code> element</strong> represents a multi-line plain-text editing control, useful when you want to allow users to enter a sizeable amount of free-form text, for example a comment on a review or feedback form.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/details\" title=\"The HTML Details Element (<details>) creates a disclosure widget in which information is visible only when the widget is toggled into an &quot;open&quot; state.\"><code>&lt;details&gt;</code></a></td>\n   <td>The <strong>HTML Details Element (<code>&lt;details&gt;</code>)</strong> creates a disclosure widget in which information is visible only when the widget is toggled into an \"open\" state.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dialog\" title=\"The HTML <dialog> element represents a dialog box or other interactive component, such as an inspector or window.\"><code>&lt;dialog&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;dialog&gt;</code> element</strong> represents a dialog box or other interactive component, such as an inspector or window.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menu\" title=\"The HTML <menu> element represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.\"><code>&lt;menu&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menu&gt;</code> element</strong> represents a group of commands that a user can perform or activate. This includes both list menus, which might appear across the top of a screen, as well as context menus, such as those that might appear underneath a button after it has been clicked.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menuitem\" title=\"The HTML <menuitem> element represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.\"><code>&lt;menuitem&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menuitem&gt;</code> element</strong> represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/summary\" title=\"The HTML Disclosure Summary element (<summary>) element specifies a summary, caption, or legend for a <details> element's disclosure box.\"><code>&lt;summary&gt;</code></a></td>\n   <td>The <strong>HTML Disclosure Summary element</strong> (<strong><code>&lt;summary&gt;</code></strong>) element specifies a summary, caption, or legend for a <a href=\"/en-US/docs/Web/HTML/Element/details\" title=\"The HTML Details Element (&amp;lt;details&amp;gt;) creates a disclosure widget in which information is visible only when the widget is toggled into an &quot;open&quot; state.\"><code>&lt;details&gt;</code></a> element's disclosure box.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/content\" title=\"The HTML <content> element—an obsolete part of the Web Components suite of technologies—was used inside of Shadow DOM as an insertion point, and wasn't meant to be used in ordinary HTML.\"><code>&lt;content&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;content&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> suite of technologies—was used inside of <a href=\"/en-US/docs/Web/Web_Components/Shadow_DOM\">Shadow DOM</a> as an <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>, and wasn't meant to be used in ordinary HTML.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/element\" title=\"The obsolete HTML <element> element was part of the Web Components specification; it was intended to be used to define new custom DOM elements.\"><code>&lt;element&gt;</code></a></td>\n   <td>The obsolete <strong>HTML <code>&lt;element&gt;</code> element</strong> was part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> specification; it was intended to be used to define new custom DOM elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/shadow\" title=\"The HTML <shadow> element—an obsolete part of the Web Components technology suite—was intended to be used as a shadow DOM insertion point.\"><code>&lt;shadow&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;shadow&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—was intended to be used as a shadow DOM <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/slot\" title=\"The HTML <slot> element—part of the Web Components technology suite—is a placeholder inside a web component that you can fill with your own markup, which lets you create separate DOM trees and present them together.\"><code>&lt;slot&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;slot&gt;</code> element</strong>—part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—is a placeholder inside a web component that you can fill with your own markup, which lets you create separate DOM trees and present them together.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/template\" title=\"The HTML Content Template (<template>) element is a mechanism for holding client-side content that is not to be rendered when a page is loaded but may subsequently be instantiated during runtime using JavaScript.\"><code>&lt;template&gt;</code></a></td>\n   <td>The <strong>HTML Content Template (<code>&lt;template&gt;</code>) element</strong> is a mechanism for holding client-side content that is not to be rendered when a page is loaded but may subsequently be instantiated during runtime using JavaScript.</td>\n  </tr>\n\n </tbody>\n</table>",
    "<table class=\"standard-table\">\n <thead>\n  <tr>\n\n   <th scope=\"col\">Element</th>\n   <th scope=\"col\">Description</th>\n  </tr>\n </thead>\n <tbody>\n \n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/acronym\" title=\"The HTML Acronym Element (<acronym>) allows authors to clearly indicate a sequence of characters that compose an acronym or abbreviation for a word. This element has been removed in HTML5. Use&nbsp;<abbr> element.\"><code>&lt;acronym&gt;</code></a></td>\n   <td>The HTML Acronym Element (<code>&lt;acronym&gt;</code>) allows authors to clearly indicate a sequence of characters that compose an acronym or abbreviation for a word. This element has been removed in HTML5. Use&nbsp;<a href=\"/en-US/docs/Web/HTML/Element/abbr\" title=\"The HTML Abbreviation element (<abbr>) represents an abbreviation or acronym; the optional title attribute can provide an expansion or description for the abbreviation.\"><code>&lt;abbr&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/applet\" title=\"The obsolete HTML Applet Element (<applet>) embeds a Java applet into the document; this element has been deprecated in favor of <object>.\"><code>&lt;applet&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Applet Element</strong> (<strong><code>&lt;applet&gt;</code></strong>) embeds a Java applet into the document; this element has been deprecated in favor of <a href=\"/en-US/docs/Web/HTML/Element/object\" title=\"The HTML <object> element represents an external resource, which can be treated as an image, a nested browsing context, or a resource to be handled by a plugin.\"><code>&lt;object&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/basefont\" title=\"The obsolete HTML Base Font element (<basefont>) sets a default font face, size, and color for the other elements which are descended from its parent element.\"><code>&lt;basefont&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Base Font element</strong> (<strong><code>&lt;basefont&gt;</code></strong>) sets a default font face, size, and color for the other elements which are descended from its parent element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/bgsound\" title=\"The Internet Explorer only HTML Background Sound element (<bgsound>) sets up a sound file to play in the background while the page is used; use <audio> instead.\"><code>&lt;bgsound&gt;</code></a></td>\n   <td>The Internet Explorer only <strong>HTML Background Sound element</strong> (<strong><code>&lt;bgsound&gt;</code></strong>) sets up a sound file to play in the background while the page is used; use <a href=\"/en-US/docs/Web/HTML/Element/audio\" title=\"The HTML <audio> element is used to embed sound content in documents. It may contain one or more audio sources, represented using the src attribute or the <source> element:&nbsp;the browser will choose the most suitable one. It can also be the destination for streamed media, using a MediaStream.\"><code>&lt;audio&gt;</code></a> instead.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/big\" title=\"The obsolete HTML Big Element (<big>) renders the enclosed text at a font size one level larger than the surrounding text (medium becomes large, for example).\"><code>&lt;big&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Big Element</strong> (<strong><code>&lt;big&gt;</code></strong>) renders the enclosed text at a font size one level larger than the surrounding text (<code>medium</code> becomes <code>large</code>, for example).</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/blink\" title=\"The HTML Blink Element (<blink>) is a non-standard element which causes the enclosed text to flash slowly.\"><code>&lt;blink&gt;</code></a></td>\n   <td>The <strong>HTML Blink Element</strong> (<code>&lt;blink&gt;</code>) is a non-standard element which causes the enclosed text to flash slowly.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/center\" title=\"The obsolete HTML Center Element (<center>) is a block-level element that displays its block-level or inline contents centered horizontally within its containing element.\"><code>&lt;center&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Center Element</strong> (<strong><code>&lt;center&gt;</code></strong>) is a <a href=\"/en-US/docs/HTML/Block-level_elements\" title=\"HTML/Block-level_elements\">block-level element</a> that displays its block-level or inline contents centered horizontally within its containing element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/command\" title=\"The HTML Command element (<command>) represents a command which the user can invoke. Commands are often used as part of a context menu or toolbar.\"><code>&lt;command&gt;</code></a></td>\n   <td>The <strong>HTML Command element</strong> (<strong><code>&lt;command&gt;</code></strong>) represents a command which the user can invoke. Commands are often used as part of a context menu or toolbar.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/content\" title=\"The HTML <content> element—an obsolete part of the Web Components suite of technologies—was used inside of Shadow DOM as an insertion point, and wasn't meant to be used in ordinary HTML.\"><code>&lt;content&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;content&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> suite of technologies—was used inside of <a href=\"/en-US/docs/Web/Web_Components/Shadow_DOM\">Shadow DOM</a> as an <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>, and wasn't meant to be used in ordinary HTML.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/dir\" title=\"The obsolete HTML Directory element (<dir>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the user agent.\"><code>&lt;dir&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Directory element</strong> (<strong><code>&lt;dir&gt;</code></strong>) is used as a container for a directory of files and/or folders, potentially with styles and icons applied by the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/element\" title=\"The obsolete HTML <element> element was part of the Web Components specification; it was intended to be used to define new custom DOM elements.\"><code>&lt;element&gt;</code></a></td>\n   <td>The obsolete <strong>HTML <code>&lt;element&gt;</code> element</strong> was part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> specification; it was intended to be used to define new custom DOM elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/font\" title=\"The HTML Font Element (<font>) defines the font size, color and face for its content.\"><code>&lt;font&gt;</code></a></td>\n   <td>The <em>HTML Font Element</em> (<code>&lt;font&gt;</code>) defines the font size, color and face for its content.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a></td>\n   <td><code>&lt;frame&gt;</code> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <a href=\"/en-US/docs/Web/HTML/Element/frameset\" title=\"<frameset> is an HTML element which is used to contain <frame> elements.\"><code>&lt;frameset&gt;</code></a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/frameset\" title=\"<frameset> is an HTML element which is used to contain <frame> elements.\"><code>&lt;frameset&gt;</code></a></td>\n   <td><code>&lt;frameset&gt;</code> is an HTML element which is used to contain <a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a> elements.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/image\" title=\"The obsolete HTML Image element (<image>) is an obsolete remnant of an ancient version of HTML lost in the mists of time; use the standard <img> element instead.\"><code>&lt;image&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Image element (<code>&lt;image&gt;</code>)</strong> is an obsolete remnant of an ancient version of HTML lost in the mists of time; use the standard <a href=\"/en-US/docs/Web/HTML/Element/img\" title=\"The HTML <img> element embeds an image into the document.\"><code>&lt;img&gt;</code></a> element instead.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/isindex\" title=\"<isindex> is an obsolete HTML element that puts a text field in a page for querying the document.\"><code>&lt;isindex&gt;</code></a></td>\n   <td><strong><code>&lt;isindex&gt;</code></strong> is an obsolete HTML element that puts a text field in a page for querying the document.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/keygen\" title=\"The HTML <keygen> element exists to facilitate generation of key material, and submission of the public key as part of an HTML form. This mechanism is designed for use with Web-based certificate management systems. It is expected that the <keygen> element will be used in an HTML form along with other information needed to construct a certificate request, and that the result of the process will be a signed certificate.\"><code>&lt;keygen&gt;</code></a></td>\n   <td>The HTML <code>&lt;keygen&gt;</code> element exists to facilitate generation of key material, and submission of the public key as part of an <a href=\"/en-US/docs/Web/Guide/HTML/Forms\">HTML form</a>. This mechanism is designed for use with Web-based certificate management systems. It is expected that the <code>&lt;keygen&gt;</code> element will be used in an HTML form along with other information needed to construct a certificate request, and that the result of the process will be a signed certificate.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/listing\" title=\"The HTML Listing Element (<listing>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML 2 standard recommended that lines shouldn't be broken when not greater than 132 characters.\"><code>&lt;listing&gt;</code></a></td>\n   <td>The <em>HTML Listing Element</em> (<code>&lt;listing&gt;</code>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML 2 standard recommended that lines shouldn't be broken when not greater than 132 characters.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/marquee\" title=\"The HTML <marquee> element is used to insert a scrolling area of text. You can control what happens when the text reaches the edges of its content area using its attributes.\"><code>&lt;marquee&gt;</code></a></td>\n   <td>The HTML <code>&lt;marquee&gt;</code> element is used to insert a scrolling area of text. You can control what happens when the text reaches the edges of its content area using its attributes.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/menuitem\" title=\"The HTML <menuitem> element represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.\"><code>&lt;menuitem&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;menuitem&gt;</code> element</strong> represents a command that a user is able to invoke through a popup menu. This includes context menus, as well as menus that might be attached to a menu button.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/multicol\" title=\"The HTML Multi-Column Layout element (<multicol>) was an experimental element designed to allow multi-column layouts and must not be used.\"><code>&lt;multicol&gt;</code></a></td>\n   <td>The <strong>HTML Multi-Column Layout element</strong> (<strong><code>&lt;multicol&gt;</code></strong>) was an experimental element designed to allow multi-column layouts and must not be used.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nextid\" title=\"<nextid> is an obsolete HTML element that served to enable the NeXT web designing tool to generate automatic NAME labels for its anchors.\"><code>&lt;nextid&gt;</code></a></td>\n   <td><strong><code>&lt;nextid&gt;</code></strong> is an obsolete HTML element that served to enable the NeXT web designing tool to generate automatic NAME labels for its anchors.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/nobr\" title=\"The non-standard, obsolete HTML <nobr> element prevents the text it contains from automatically wrapping across multiple lines, potentially resulting in the user having to scroll horizontally to see the entire width of the text.\"><code>&lt;nobr&gt;</code></a></td>\n   <td>The non-standard, obsolete HTML <code>&lt;nobr&gt;</code> element prevents the text it contains from automatically wrapping across multiple lines, potentially resulting in the user having to scroll horizontally to see the entire width of the text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noembed\" title=\"The <noembed> element is an obsolete, non-standard way to provide alternative, or &quot;fallback&quot;, content for browsers that do not support the <embed> element or do not support the type of embedded content an author wishes to use.\"><code>&lt;noembed&gt;</code></a></td>\n   <td>The <code><strong>&lt;noembed&gt;</strong></code> element is an obsolete, non-standard way to provide alternative, or \"fallback\", content for browsers that do not support the <a href=\"/en-US/docs/Web/HTML/Element/embed\" title=\"The HTML <embed> element embeds external content at the specified point in the document. This content is provided by an external application or other source of interactive content such as a browser plug-in.\"><code>&lt;embed&gt;</code></a> element or do not support the type of <a href=\"/en-US/docs/Web/Guide/HTML/Content_categories#Embedded_content\">embedded content</a> an author wishes to use.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/noframes\" title=\"The obsolete HTML No Frames or frame fallback element, <noframes>, provides content to be presented in browsers that don't support (or have disabled support for) the <frame> element.\"><code>&lt;noframes&gt;</code></a></td>\n   <td>The obsolete HTML <strong>No Frames</strong> or <strong>frame fallback</strong> element, <strong><code>&lt;noframes&gt;</code></strong>, provides content to be presented in browsers that don't support (or have disabled support for) the <a href=\"/en-US/docs/Web/HTML/Element/frame\" title=\"<frame> is an HTML element which defines a particular area in which another HTML document can be displayed. A frame should be used within a <frameset>.\"><code>&lt;frame&gt;</code></a> element.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/plaintext\" title=\"The HTML Plaintext Element (<plaintext>) renders everything following the start tag as raw text, without interpreting any HTML. There is no closing tag, since everything after it is considered raw text.\"><code>&lt;plaintext&gt;</code></a></td>\n   <td>The <em>HTML Plaintext Element</em> (<code>&lt;plaintext&gt;</code>) renders everything following the start tag as raw text, without interpreting any HTML. There is no closing tag, since everything after it is considered raw text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/shadow\" title=\"The HTML <shadow> element—an obsolete part of the Web Components technology suite—was intended to be used as a shadow DOM insertion point.\"><code>&lt;shadow&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;shadow&gt;</code> element</strong>—an obsolete part of the <a href=\"/en-US/docs/Web/Web_Components\">Web Components</a> technology suite—was intended to be used as a shadow DOM <a rel=\"nofollow\" href=\"/en-US/docs/Glossary/insertion_point\" class=\"glossaryLink new\" title=\"The definition of that term (insertion point) has not been written yet; please consider contributing it!\">insertion point</a>.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/spacer\" title=\"<spacer> is an obsolete HTML element which allowed insertion of empty spaces on pages. It was devised by Netscape to accomplish the same effect as a single-pixel layout image, which was something web designers used to use to add white spaces to web pages without actually using an image. However, <spacer> no longer supported by any major browser and the same effects can now be achieved using simple CSS. \"><code>&lt;spacer&gt;</code></a></td>\n   <td><strong><code>&lt;spacer&gt;</code></strong> is an obsolete HTML element which allowed insertion of empty spaces on pages. It was devised by Netscape to accomplish the same effect as a single-pixel layout image, which was something web designers used to use to add white spaces to web pages without actually using an image. However, <code>&lt;spacer&gt;</code> no longer supported by any major browser and the same effects can now be achieved using simple CSS. </td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/strike\" title=\"The HTML <strike> element&nbsp;(or&nbsp;HTML Strikethrough Element) places&nbsp;a strikethrough (horizontal line) over text.\"><code>&lt;strike&gt;</code></a></td>\n   <td>The <strong>HTML <code>&lt;strike&gt;</code> element</strong>&nbsp;(or&nbsp;<em>HTML Strikethrough Element</em>) places&nbsp;a strikethrough (horizontal line) over text.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/tt\" title=\"The obsolete HTML Teletype Text element (<tt>) creates inline text which is presented using the user agent's default monospace font face.\"><code>&lt;tt&gt;</code></a></td>\n   <td>The obsolete <strong>HTML Teletype Text element</strong> (<strong><code>&lt;tt&gt;</code></strong>) creates inline text which is presented using the <a href=\"/en-US/docs/Glossary/user_agent\" class=\"glossaryLink\" title=\"user agent's: A user agent is a computer program representing a person, for example, a browser in a Web context.\">user agent's</a> default monospace font face.</td>\n  </tr>\n\n  <tr>\n\n   <td style=\"vertical-align: top;\"><a href=\"/en-US/docs/Web/HTML/Element/xmp\" title=\"The HTML Example Element (<xmp>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML2 specification recommended that it should be rendered wide enough to allow 80 characters per line.\"><code>&lt;xmp&gt;</code></a></td>\n   <td>The <em>HTML Example Element</em> (<code>&lt;xmp&gt;</code>) renders text between the start and end tags without interpreting the HTML in between and using a monospaced font. The HTML2 specification recommended that it should be rendered wide enough to allow 80 characters per line.</td>\n  </tr>\n\n </tbody>\n</table>",
   
]